INSERT INTO `mac_vod` VALUES ('2', '偏偏喜欢你', '', 'pianpianxihuanni', 'P', '', 'http://img.jijizy.com/upload/vod/2015-06-16/201561620535813257.png', '', '', '陈乔恩 贾乃亮 郑爽 黄宗泽 张云龙', '吴锦源', '', '', '大陆', '国语', '2015', '12', '', '', '0', '0', '0', '34', '0', '0', '0', '0', '333', '1', '1', '1', '0', '0', '0', '3.0', '1494', '498', '1436186538', '1436187159', '1436191954', '0', '1916年，平民女孩钱宝宝为救治病重的母亲，顶替意外身亡的留洋女博士章晗的身份，进入龙城军校，成为一群热血男儿的女教官。本想治好母亲的病就离开，不想却卷入到一场三角恋爱中无法自拔，一边是热情追求的项昊，一边是章晗的未婚夫沈文涛。为了不泄露真实身份，钱宝宝既要逃避和项昊之间与日俱增的感情，又要打消沈文涛的怀疑和试探。情感纠葛之下，危机浮现，原来章晗并没有死，她的归来让钱宝宝面临良心的拷问。日本黑势力对龙城虎视眈眈，军校陷入危险中。钱宝宝与军校里一帮热血男儿们为了国家和民族大义，团结一致，众志成城，一次次地粉碎了敌人的阴谋，成功化解了危机。最终钱宝宝的坚韧和善良得到了大家的谅解，并且和项昊有情人终成眷属。', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://31616|1925b74e49e1d8e4c67fe859354ea0319f8dcb17|偏偏喜欢你_HDTV_01.mkv#第02集$jjhd://31616|0d47e4981a968da97bf3b000048d3caffcd62f09|偏偏喜欢你_HDTV_02.mkv#第03集$jjhd://31616|e63fbaae784c0a1f7148dbf939d190c9095048ba|偏偏喜欢你_HDTV_03.mkv#第04集$jjhd://20000|b9305881cba4e9d4680ca2d8bc05ec2a7b52f3f6|偏偏喜欢你HDTV04.mp4#第05集$jjhd://31616|3ef783da367a6df2906b1bfb09c6086351edb235|偏偏喜欢你_HDTV_05.mkv#第06集$jjhd://31616|1fea62768e345eebb1815acee990032913a1d6ab|偏偏喜欢你_HDTV_06.mkv#第07集$jjhd://31616|bc7a918f419a4a06dcc28c3555f2de11a7121b43|偏偏喜欢你_HDTV_07.mkv#第08集$jjhd://31616|bb90f1cb15956898aca07e94fef090fba696d9e9|偏偏喜欢你_HDTV_08.mkv#第09集$jjhd://31616|a9ec795042c44280972a1e381fee803e311d7125|偏偏喜欢你_HDTV_09.mkv#第10集$jjhd://31616|8b720577dd64b151db46388ab47f5863e5fd7fba|偏偏喜欢你_HDTV_10.mkv#第11集$jjhd://31616|91e75e42913547e33c44cf69523f0de23de8ac73|偏偏喜欢你_HDTV_11.mkv#第12集$jjhd://31616|e333e74c6577f404a05ed81cbe141d26c0e53c51|偏偏喜欢你_HDTV_12.mkv#第13集$jjhd://31616|7f4c21642b3888790f60bcfac3846f487eb89d0d|偏偏喜欢你_HDTV_13.mkv#第14集$jjhd://31616|78b95a38229e01c089f83475ded5a3004d2cde1e|偏偏喜欢你_HDTV_14.mkv#第15集$jjhd://31616|5103c3ad60a83c4d3142ecf51bbd10312724c08f|偏偏喜欢你_HDTV_15.mkv#第16集$jjhd://20000|77b4eeb6c472ca2851420a5a00587151b888cffb|偏偏喜欢你HDTV16.mp4#第17集$jjhd://31616|b4cd45e88df31fee93ef9e238097d506a2ff2f04