INSERT INTO `mac_vod` VALUES ('3', '淑女涩男', '', 'shunvsenan', 'S', '', 'http://img.jijizy.com/upload/vod/2015-07-4/20157422181050506.jpg', '', '', '谢帅 李梓溪 蔡蝶 张骁晗 刘炫锐', '何念', '', '', '大陆', '国语', '2015', '12', '', '', '0', '0', '0', '3', '0', '0', '0', '0', '528', '0', '0', '0', '0', '0', '0', '9.0', '576', '64', '1436186538', '1436187159', '0', '0', '杨豆豆将母亲给的钱借给好友林大卫投资却失败，为了圆谎，租了美斯特对面的厕所拉上马浮云成立了一家手机软件公司。梦想成为时装设计师的余娅刚经受完失恋加失业的双重打击，又遇人不淑，碰上马浮云这样“过分靠谱”的IT怪咖男青年，害她面试美斯特公司因迟到失败。为了找到容身之所，余娅勉强加入3Y手机软件小公司作前台，却反客为主，心甘情愿留下做了这里的主心骨。马浮云开发了一个个“不靠谱”的离奇软件，几个年轻人为了“上市”梦拼搏努力着，惹出了一桩桩笑话。余娅帮助了马浮云克服了初恋魔咒邓莎的心理障碍，马浮云也把余娅从水深火热的极品家庭中挽救了出来，逐渐地，这一对冤家男女，不知不觉的爱上了对方。美斯特公司设计总监安敏是个相亲控、“白骨精”，早就为自己择偶定下了高大上的模板，却一头栽进了青涩男孩杨豆豆为她准备好的麻袋。', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://20000|8d9b38b2567a3dad0680578d05e3e0d7e07d59cf|淑女涩男01.mkv#第02集$jjhd://20000|2ca1825a8b9e967e524a28a99e55d42b5aaa7d7b|淑女涩男TV02.mp4#第03集$jjhd://20000|e3d71109a4141fdb1f589c3411a0183d5a9a9199|淑女涩男TV03.mp4$$$第01集$ftp://a.gbl.114s.com:20320/6719/淑女涩男TV01.mkv#第02集$ftp://a.gbl.114s.com:20320/0821/淑女涩男TV02.mp4#第03集$ftp://a.gbl.114s.com:20320/0367/淑女涩男TV03.mp4#第04集$ftp://a.gbl.114s.com:20320/5310/淑女涩男TV04.mkv', '', '', '', '');
