INSERT INTO `mac_vod` VALUES ('6', '武媚娘传奇[港版]', '', 'wumeiniangchuanqigangban', 'W', '', 'http://img.jijizy.com/upload/vod/2015-04-27/201542716342756013.jpg', '', '', '范冰冰 李治廷 张丰毅 周海媚 张馨予', '高翊浚', '', '', '大陆', '粤语', '2015', '12', '', '', '0', '0', '0', '67', '0', '0', '0', '0', '750', '0', '0', '0', '0', '0', '0', '3.0', '66', '22', '1436186538', '1436186538', '0', '0', '故事开始于贞观十一年，如意（范冰冰 饰）参加大唐后宫选举，以一支《兰陵王入阵曲》之物震惊四座，吸引了唐太宗李世民（张丰毅 饰）的注意。然而，春风得意的如玉惨遭奸人所害，还未承宠便被打入了冷宫。一年后，如意被放出冷宫，在宫中的地位节节攀升，这为她带来了爱情与荣耀，却也将其置于了危险之中。 　　李世民听信谗言离开了如意，心碎的如意削发为尼发誓断绝尘缘。然而，腹中的孩子令她决心重回宫中，没想到这一决定却断送了她尚未出世的孩子的性命。复仇心切的如意转而投向了唐高宗李治（李治廷 饰），却同其产生了一段真挚的感情，永微六年，如意终于在一条血路之中攀上了皇后的宝座。', 'jjvod', '0', '', '第01集$jjhd://20000|ea5c901175db406e60e668829ddbe9d9227f259d|武则天[720p粤语][第1集].rmvb#第02集$jjhd://20000|ead7038971a755b646f20ceca025761cdc90099b|武则天[高清TV粤语]02.rmvb#第03集$jjhd://20000|802a5308795d4ad9d4c1a87842499d6fa0b30320|武则天[720p粤语][第3集].rmvb#第04集$jjhd://20000|029fbe751fd9f76935bfa13421f9d658f7ed7f89|武则天[720p粤语][第4集].rmvb#第05集$jjhd://20000|14fda21df599430c6d72de328fc2c8353ac7bf64|武则天[720p粤语]05.rmvb#第06集$jjhd://20000|e25d240c32934009bc26d41b62a8e23600402a4f|武则天[720p粤语][第6集].rmvb#第07集$jjhd://20000|669b66917a46cf5513b1e2e571eb69e7ad38af09|武则天粤语07.rmvb#第08集$jjhd://20000|38fd98667338e64ede3b78fcbe70860871e63339|武则天[720p粤语][第8集].rmvb#第09集$jjhd://20000|5da763359cf0d015b78d691c9672f6f982a3c578|武则天[720p粤语][第9集].rmvb#第10集$jjhd://20000|5c53736f17d423b6e178a378153f5195265b5deb|武则天[高清TV粤语]10.rmvb#第11集$jjhd://20000|d9c8c8de045caa3d6f706798ea4eef94ac249c43|武则天粤语HDTV11.mkv#第12集$jjhd://20000|b2933ddfe4d5fb8ea52852319e47ddcdf22f95d3|武则天粤语HDTV12.mkv#第13集$jjhd://20000|54b9a08faa6f1dc0247e0de4682221b2dda8de81|武则天粤语HDTV13.mkv#第14集$jjhd://20000|9403dd72e6fba728cca21aee66e75fb9d6109c96|武则天粤语HDTV14.mkv#第15集$jjhd://20003|ee6c57150a33ec7691db35cf9495ef8835798d1e|武则天粤语HDTV15.mkv#第16集$jjhd://20000|757cf35eddd5db33e7163cf42290b500bbab8abc|武则天粤语hdtv16.mp4#第17集$jjhd://20000|dd613c47b7d3991875c846a0cf3c72743670db54|武则天[720p粤语][第17集].rmvb#