INSERT INTO `mac_vod` VALUES ('8', '花千骨', '', 'huaqiangu', 'H', '', 'http://img.jijizy.com/upload/vod/2015-06-9/2015692385347997.jpg', '', '', '霍建华 赵丽颖 蒋欣 杨烁 张丹峰 李纯', '林玉芬 高林豹 梁胜权', '', '', '大陆', '国语', '2015', '12', '', '', '0', '0', '0', '18', '0', '0', '0', '0', '444', '1', '1', '1', '0', '0', '0', '4.0', '1160', '290', '1436186538', '1436187128', '1436188049', '0', '为寻恩人，花千骨前往长留仙山。在白子画暗暗帮助下，花千骨几经波折经过重重考验拜为其座下唯一的弟子。师徒二人亦师亦友，皆以匡扶正义保护上古十大神器为己任。二人游历人间，救助孤寡，锄强扶弱。朝夕相对，让花千骨对白子画产生了深深的爱慕执念。而深爱白子画的堕仙夏紫薰为异朽阁主设计，为破白子画的劫数，投毒加害花千骨，白子画为救花千骨身中剧毒。花千骨不惜偷盗神器为师父解毒，不料阴差阳错之下放出妖神，并于无意中得到洪荒之力。自此，六界动乱不堪，百姓民不聊生。白子画既要匡顾天下，又要保护花千骨，费尽心力，身受重伤。', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://31616|36d05e563436be16d10e12cedba48f101905b030|花千骨_HDTV_01.mkv#第02集$jjhd://31616|b151e477f3fe23eb0160f8a0e4859b22924d0162|花千骨_HDTV_02.mkv#第03集$jjhd://31616|59c010732f6b7835b3980e2e50585df02919c296|花千骨_HDTV_03.mkv#第04集$jjhd://31616|01536bb44566adcfcfb0024c63ae74bbca1738a2|花千骨_HDTV_04.mkv#第05集$jjhd://31616|4dfca4d1e6d2d8063a988f39243b7e5c5ca30b4c|花千骨_HDTV_05.mkv#第06集$jjhd://31616|f64c6873aba9fe9e20b782b3676e00f28d01befe|花千骨_HDTV_06.mkv#第07集$jjhd://20000|0768d012cafaef3d0a9520f6f0433dbb670a5b4d|花千骨HDTV07.mp4#第08集$jjhd://20000|4f772e6f92e73370e620a90a95350a50a26bb90a|花千骨HDTV08.mp4#第09集$jjhd://31616|43259ede0928994717994f76e7444b3be232fea4|花千骨_HDTV_09.mkv#第10集$jjhd://31616|11fc547709178b87b1fdbeb52b72fe7c92ce1396|花千骨_HDTV10.mkv#第11集$jjhd://31616|05d31f5683d02a73bad7e6d15764c958e61ae917|花千骨_HDTV11.mkv#第12集$jjhd://31616|70f7e77880aa189827bd17a5897eac1b0ce79bc1|花千骨_HDTV12.mkv#第13集$jjhd://31616|de6bfd34212220cd58d922691af8b9a2d317f42d|花千骨_HDTV_13.mkv#第14集$jjhd://31616|7a41b41617547c9fca92f72d294af23fca494aeb|花千骨_HDTV_14.mkv#第15集$jjhd://31616|2a3831c8c4ac56697de6af8519f5922994d5b9c1|花千骨_HDTV_15.mkv#第16集$jjhd://31616|d5e65fc2a7d2d0141943218e649191f6068fa3e6|花千骨_HDTV_16.mkv#第17集$jjhd://31616|48083e6e74e9838fd514e07c7a4f66a48d021a7b|花千骨_HDTV_17.mkv#第18集$jjhd://31616|44b9bc4fb6e09497ae8bed62f901da6c12286cb7|花千骨_HDTV_18.m