INSERT INTO `mac_vod` VALUES ('12', '爸爸父亲爹', '', 'babafuqindie', 'B', '', 'http://img.jijizy.com/upload/vod/2015-07-3/20157320191263555.jpg', '', '', '罗晋 罗嘉良 张晞临', '于敏', '', '', '大陆', '国语', '2015', '12', '', '', '0', '0', '0', '5', '0', '0', '0', '0', '644', '0', '0', '0', '0', '0', '0', '2.0', '440', '220', '1436186538', '1436187159', '0', '0', '罗晋 饰演的宁五原有三位养父，立场与信 仰却各不相同。为了完成组织交代的 任务，宁五原在三个养父之间周旋并 寻找真相。在这个过程中，他也解开 了自己的身世之谜。', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://20000|8312eebf7b174e8f347b1b845e9cdf7bca03a04e|爸爸父亲爹HDTV01.mp4#第02集$jjhd://20000|6ed89429e4baf8fbde7a7550272a2034f8d1ec48|爸爸父亲爹HDTV02.mp4#第03集$jjhd://20000|24b3d062c15899e3a599536b084b5564fb6fdc07|爸爸父亲爹HDTV03.mp4#第04集$jjhd://20000|0b277e764b63a1e9ff1d5d9cdfb471e324a70692|爸爸父亲爹04.mp4#第05集$jjhd://20000|f84e67f0b3fe899b19a8762898a29fdf9c974f3c|爸爸父亲爹05.mp4$$$第01集$ftp://a.gbl.114s.com:20320/9267/爸爸父亲爹HDTV01.mp4#第02集$ftp://a.gbl.114s.com:20320/2986/爸爸父亲爹HDTV02.mp4#第03集$ftp://a.gbl.114s.com:20320/7843/爸爸父亲爹HDTV03.mp4#第04-05集$ftp://a.gbl.114s.com:20320/6454/爸爸父亲爹HDTV04-05.mp4#第06集$ftp://a.gbl.114s.com:20320/9474/爸爸父亲爹HDTV06.mp4#第07集$ftp://a.gbl.114s.com:20320/6705/爸爸父亲爹HDTV07.mp4', '', '', '', '');
INSERT INTO `mac_vod` VALUES ('13', '精彩好生活', '', 'jingcaihaoshenghuo', 'J', '', 'http://img.jijizy.com/upload/vod/2015-07-6/201576134926771.jpg', '', '', '伊一 秦海璐 汪东城 孙佳奇 魏晨', '浙江卫视', '', '', '大陆', '国语', '2015', '3', '', '', '0', '0', '0', '20150705', '0', '0', '0', '0', '969', '0', '0', '0', '0', '0', '0', '7.0', '2261', '323', '1436186538', '1436186538', '0', '0', '《精彩好生活》是浙江卫视打造的首档大型明星生活实验节目，首期节目在浙江诸葛八卦村录制，节目嘉宾阵容：秦海璐、汪东城、魏晨、高以翔、孙佳奇、伊一等。 　　节目让明星体验衣食住行各个方面的缺失，体现生活中那些不起眼事物的重要性，让明星返璞归真，摆脱依赖、玩出新花样，明星们将共同合作完成生活实验，节目呼吁人类关注身边最容易忽视的东西，找到最简单的小幸福。', 'jjvod', '0', '', '20150705$jjhd://20000|85b3ce076d0fb968691a369d19396c5bf0adcff4|精彩好生活20150705.mkv', '', '', '', '');
INSERT INTO `mac_vod` VALUES ('14', '六扇门之玄武初现', '', 'liushanmenzhixuanwuchuxian', 'L', '', 'http://img.jijizy.com/upload/vod/2015-07-6/2015761165945550.jpg', '', '', '吴毅将 徐亮 陶洋', '黄祖权', '', 'BD', '大陆', '国语', '2015', '10', '', '', '0', '0', '0', '0', '0', '0', '0', '0', '567', '510', '1', '1', '0', '0', '0', '7.0', '294', '42', '1436186538', '1436186538', '1436187014', '0', '多年前一次失误，捕头周冲多名部下丧命玄铁镖，周冲也一蹶不振。最近内阁大臣蒋进之女遭绑架，案发现场竟发现了玄铁镖踪迹，周冲请命重回六扇门，顺藤摸瓜打入敌穴，救出蒋进之女，并一步步接近当年阴谋的真相……', 'jjvod', '0', '', 'BD$jjhd://20000|21d32ecd3746ab1aea6d6fa19f362168613b9077|六扇门之双面人BD.mp4', '', '', '', '');
INSERT INTO `mac_vod` VALUES ('15', '武林风2015', '', 'wulinfeng2015', 'W', '', 'http://img.jijizy.com/upload/vod/2015-07-6/2015761181659819.jpg', '', '', '郭晨冬', '内详', '', '', '大陆', '国语', '2015', '3', '', '', '0', '0', '0', '20150704', '0', '0', '0', '0', '265', '0', '0', '0', '0', '0', '0', '10.0', '4490', '449', '1436186538', '1436186538', '0', '0', '《武林风》是一档大型武术娱乐栏目，全方位、多角度展现中华武学的博大精深，是中国传统武术文化和现代电视艺术的完美结合，缤纷云集的武术套路、酣畅痛快的搏击场面、源远流长的文化底蕴、名星大腕现场助阵，使得《武林风》迅速成长为中华武术娱乐栏目第一品牌。《武林风》栏目每年举行的六大国际赛事（中美、中欧、中日、中泰、中伊、中越），为中国武术走向世界提供了很好的平台，同时也大大提高了《武林风》栏目的影响力。', 'jjvod', '0', '', '20150704$jjhd://20000|f934a02fb6247ea7bbb1bd690a788c76b62f955f|武林风-20150704.mp4', '', '', '', '');
