INSERT INTO `mac_vod` VALUES ('17', '我的美丽新娘', '', 'wodemeilixinniang', 'W', '', 'http://img.jijizy.com/upload/vod/2015-06-22/201562214422114417.jpg', '', '', '金武烈 李诗英 高胜熙 柳承秀 朴海俊', '金哲奎', '', '', '韩国', '韩语', '2015', '14', '', '', '0', '0', '0', '5', '0', '0', '0', '0', '270', '0', '0', '0', '0', '0', '0', '6.0', '2106', '351', '1436186538', '1436187128', '0', '0', '为了寻找消失的新娘而孤军奋斗的金度型（金武烈饰）、度型的未婚妻尹洙英（高胜熙饰）、在公和私之间矛盾万分，内柔外刚的热血刑警车允美（李诗英饰），在30岁时，终于圆满了自幼年期就梦想的警察职业。而度型对立的组织的核心人物许真基（柳承修饰）、陷入允美热情魅力的警察朴炯植（朴海俊饰），是一个想兼收事业和爱情，最终却失去了所有的悲剧性人物。', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://20000|a2c7020271dc6c0dde77b492a3fee7ba0fc9e61f|我的美丽新娘01.mkv#第02集$jjhd://20000|73dd985021f010a12a940e9cc46f724318e1f86f|我的美丽新娘02.mkv#第03集$jjhd://20000|ad4b6514bafd25215b83d7796bd6cc0c3dd97077|我的美丽新娘03.mkv#第04集$jjhd://20000|970fbf895057f2ccdd56205a7c482399ddfaa3e1|我的美丽新娘04.mkv#第05集$jjhd://20000|a0716461028bc404916741acd281fe0df9819fbc|我的美丽新娘05.mkv$$$第01集$ftp://a.gbl.114s.com:20320/1723/我的美丽新娘01.mkv#第02集$ftp://a.gbl.114s.com:20320/5200/我的美丽新娘02.mkv#第03集$ftp://a.gbl.114s.com:20320/4363/我的美丽新娘03.mkv#第04集$ftp://a.gbl.114s.com:20320/5124/我的美丽新娘04.mkv#第05集$ftp://a.gbl.114s.com:20320/1989/我的美丽新娘05.mkv', '', '', '', '');
