INSERT INTO `mac_vod` VALUES ('23', '噬神者', '', 'shishenzhe', 'S', '', 'http://img.jijizy.com/upload/vod/2015-07-6/2015768311275101.jpg', '', '', '木岛隆一  平田广明   中井和哉', '万代南梦宫', '', '', '日本', '日语', '2015', '4', '', '', '0', '0', '0', '0', '0', '0', '0', '0', '352', '0', '0', '0', '0', '0', '0', '3.0', '363', '121', '1436186546', '1436187137', '0', '0', '2071年，极东——此处是荒神的国度（领域）2050年代初，突然出现的未知生命体「神谕細胞」，开始了对地球上所有生物的「捕食」。吃光一切，可以变化为多种形态的凶暴生命体，人类畏惧地将其称为「荒神」。现存的兵器在荒神的面前毫无效果，都市文明早就崩坏，人类的生存圈在一点点被剥夺。在这样的人类面前仅存一线光明——开发了埋入神谕细胞的生体兵器「神机」，以及操作它的特殊部队，通称「噬神者」「ゴッドイーター」的编成。被荒神残虐的世界，以及「噬神的人们」未来战斗的序幕已经打开', 'jjvod$$$xigua', '0$$$', '$$$', '第00集$jjhd://20000|31d451211c0730ef3bb2e51c7e7731c0d5f4621f|噬神者00.mp4$$$第01集$ftp://a.gbl.114s.com:20320/0845/噬神者00.mp4', '', '', '', '');
INSERT INTO `mac_vod` VALUES ('24', '死亡笔记日剧版', '', 'siwangbijirijuban', 'S', '', 'http://img.jijizy.com/upload/vod/2015-07-6/201576833498575.jpg', '', '', '洼田正孝   山崎贤人  优希美青   佐野雏子', '猪股隆一  西村了', '', '', '日本', '日语', '2015', '14', '', '', '0', '0', '0', '1', '0', '0', '0', '0', '639', '0', '0', '0', '0', '0', '0', '4.0', '1332', '333', '1436186546', '1436187137', '0', '0', '《死亡笔记》讲述天才高中生夜神月某天捡到死神遗落在人间的笔记本，名字被写在这个本子上的人就会真的死去。厌倦腐朽世界的夜神月使用笔记本的力量，开始杀死犯罪者，以此希望建立一个没有犯罪的美好理想世界，而自己成为“新世界的神”。 连续罪犯死亡事件，吸引了全世界警察的目光，更吸引了世界第一名侦探L的注意……《死亡笔记 日剧版》男主角夜神月由洼田正孝出演，月的对手“L”由山崎贤人出演，而原作中为男性的“N”尼亚，则由女演员优希美青饰演。 　　《死亡笔记 日剧版》将在今年7月逢周日在日本电视台播出。', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://20000|958e472ddec45325c5c7ed9936edff5eba369152|死亡笔记01.mkv$$$第01集$ftp://a.gbl.114s.com:20320/7169/死亡笔记01.mp4', '', '', '', '');
INSERT INTO `mac_vod` VALUES ('25', '想吃什锦面', '', 'xiangchishijinmian', 'X', '', 'http://img.jijizy.com/upload/vod/2015-05-31/201553114115523228.png', '', '', '菅田将暉   本郷奏多  泉澤祐希', '清水一彦', '', '', '日本', '日语', '2015', '14', '', '', '0', '0', '0', '6', '0', '0', '0', '0', '505', '0', '0', '0', '0', '0', '0', '9.0', '2556', '284', '1436186546', '1436187128', '0', '0', '本片由创作歌手佐田雅志连载中自传小说改编，讲述他中学时代开始到学习小提琴，13岁由故乡长崎到东京，到处闯荡遭遇挫折，直到大学退学，回到故乡组成民谣组合，是1965-70年代的恋爱友情故事', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://20000|2572f24fc6120ec587624d5809fb05fa75ec97a2|想吃什锦面01.mp4#第02集$jjhd://20000|d5fca534c99e019538c5f8386234a6fc6eb92edb|想吃什锦面02.mp4#第03集$jjhd://20000|a53c9e476c52201a67077b3d196e98798640795e|想吃什锦面03.mp4#第04集$jjhd://20000|d4be52700ecb0d2465d640fa255ebcb18c610ed0|想吃什锦面04.mp4#第05集$jjhd://20000|d33abd4d411383e91741767ed20ee46b087680ae|想吃什锦面05.mp4#第06集$jjhd://20000|789622ccfaa85bab3c7ef916d5f356ac4aa06368|想吃什锦面06.mp4$$$第01集$ftp://a.gbl.114s.com:20320/5939/想吃什锦面01.mp4#第02集$ftp://a.gbl.114s.com:20320/5663/想吃什锦面02.mkv#第03集$ftp://a.gbl.114s.com:20320/4134/想吃什锦面03.mp4#第04集$ftp://a.gbl.114s.com:20320/9023/想吃什锦面04.mp4#第05集$ftp://a.gbl.114s.com:20320/6700/想吃什锦面05.mp4#第06集$ftp://a.gbl.114s.com:20320/7803/想吃什锦面06.mkv', '', '', '', '');
