INSERT INTO `mac_vod` VALUES ('28', '爱吃拉面的小泉同学', '', 'aichilamiandexiaoquantongxue', 'A', '', 'http://img.jijizy.com/upload/vod/2015-06-30/20156301327544889.jpg', '', '', '美山加恋 古畑星夏', '松木創', '', '', '日本', '日语', '2015', '14', '', '', '0', '0', '0', '2', '0', '0', '0', '0', '934', '0', '0', '0', '0', '0', '0', '9.0', '549', '61', '1436186546', '1436187137', '0', '0', '故事讲述主角小泉同学是有着「像碱水黄色」头发的美少女，对拉面以外其他一切无兴趣，也不考虑交朋友。她有着丰富的拉面知识，有去偏远地方吃拉面的极高行动力和执着，会因为想吃的拉面暂停营业而倒在店门前。她外型很瘦但却很大食，虽然看似是宅女但成绩良好，也意外地懂德语，拉面当中比较不擅长吃激辛系但也爱吃。她的同班同学大泽悠是个积极的短发女生，她喜欢可爱的女生，于是对小泉同学异常执着，想和她交朋友而跟她一起去吃拉面，但小泉基本上不理会她，让她更进一步想亲近小泉。她本身擅长料理，曾为小泉炮制拉面而让她大满足。另一同学中村美沙是受欢迎的双马尾女生，对美容的知识非常丰富，因为觉得可爱的小泉对她有威胁而抱有嫉妒心，不过后来因为一起吃拉面而化解，大爱吃辣。另外还有一位同学高桥润，是个长发眼镜少女，成绩优秀是班级的委员长，因为戴眼镜会起雾的关系不太爱热食的拉面。', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://20000|b062edeabd118b1f44d167f56cf0a018a4275ba2|爱吃拉面的小泉同学01.mkv#第02集$jjhd://20000|aba36daaf3f9489350af37f25ff36f1b609e074f|爱吃拉面的小泉同学02.mkv$$$第01集$ftp://a.gbl.114s.com:20320/8484/爱吃拉面的小泉同学01.mkv#第02集$ftp://a.gbl.114s.com:20320/2855/爱吃拉面的小泉同学02.mkv', '', '', '', '');
INSERT INTO `mac_vod` VALUES ('29', '越界追踪第二季', '', 'yuejiezhuizongdierji', 'Y', '', 'http://img.jijizy.com/upload/vod/2014-10-24/2014102422495361154.jpg', '', '', '威廉·菲德内尔 唐纳德·萨瑟兰', 'NBC', '', '全集', '欧美', '英语', '2014', '15', '', '', '0', '0', '0', '12', '0', '0', '0', '0', '939', '0', '0', '0', '0', '0', '0', '9.0', '3969', '441', '1436186546', '1436187137', '0', '0', '《越界追踪第二季》将有12集，9月22号开始相关的制作拍摄工作。拍摄地包括法国，捷克，摩洛哥和保加利亚。 《越界追踪第一季》常规角色包括William Fichtner, Donald Sutherland, Marc Lavoine, Tom Wlaschiha, Gabriella Pession 和Richard Flood都将回归。 《越界追踪》已经在超过180个地区播出，可惜的是在美国却反应惨淡，因此NBC尚未宣布是否会续订本剧第二季。', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://20000|5e18a09afe7e51876431a788e1828ed6ebfa0977|越界追踪第二季01.mp4#第02集$jjhd://20000|981019d630e24793fbd04f1056bf20aa0f5eec5a|越界追踪第二季02.mkv#第03集$jjhd://20000|09d8ae7661b04979ea4958000a4080aa7b1fd649|越界追踪第二季03.mkv#第04集$jjhd://20000|75f7a9b44a53b1bf8325c4ac50758a13e95cbb98|越界追踪第二季04.mp4#第05集$jjhd://20000|98cf98c8f9df42ed08146c4b6605367be6ef3df6|越界追踪第二季05.mp4#第06集$jjhd://20000|0c064326721d3cd9671570029e5bb78b8bb69537|越界追踪第二季06.mp4#第07集$jjhd://20000|aa784d990f744a4038493e240ca4960b2f2cdb2b|越界追踪第二季07.mp4#第08集$jjhd://20000|bf5211278aa9c4e92819dcc7451112064d88e533|越界追踪第二季08.mp4#第09集$jjhd://20000|4963c448aecc071142c5873ff116e58f2318c944|越界追踪第二季09.mp4#第10集$jjhd://20000|6eb59053455616a58045f9f0a2649fbf61b6de55|越界追踪第二季10.mp4#第11集$jjhd://20000|b7d4d53524d5ac53dad2588be47617e647a0fc98|越界追踪S02E11.mp4#第12集$jjhd://20000|052b86795cd2988534f3bebbf43905f2e9d6272d|越界追踪第二季12End.mp4$$$第01集$ftp://a.gbl.114s.com:20320/7274/越界追踪第二季01.mp4#第02集$ftp://a.gbl.114s.com:20320/9769/越界追踪第二季02.mkv#第03集$ftp://a.gbl.114s.com:20320/7667/越界追踪第二季03.mkv#第04集$ftp://a.gbl.114s.com:20320/6463/越界追踪第二季04.mp4#第05集$ftp://a.gbl.114s.com:20320/0979/越界追踪第二季05.mp4#第06集$ftp://a.gbl.114s.com:20320/2097/越界追踪第二季06.mp4#第07集$ftp://a.gbl.114s.com:20320/2846/越界追踪第二季07.mp4#第08集$ftp://a.gbl.114s.com:20320/1047/越界追踪第二季08.mp4#第09集$ftp://a.gbl.114s.com:20320/9901/越界追踪第二季09.mp4#第10集$ftp://a.gbl.114s.com: