INSERT INTO `mac_vod` VALUES ('31', '今晚睇李', '', 'jinwandili', 'J', '', 'http://img.jijizy.com/upload/vod/2015-03-9/20153910471454464.jpg', '', '', '李思捷 单立文 吴君如', '内详', '', '', '香港', '粤语', '2015', '3', '', '', '0', '0', '0', '22', '0', '0', '0', '0', '782', '0', '0', '0', '0', '0', '0', '5.0', '1075', '215', '1436186546', '1436187128', '0', '0', '玩嘢王」李思捷曾向圈中好友设下形形色色的整蛊陷阱，虽说为「被玩者」及观众们带来无限的惊喜与欢笑，但同时亦「得罪」不少朋友，无不对他避之则吉。思捷「知衰」决定「大洗底」，正正经经担起主持大旗，发挥搞笑本色，以「正当」方式娱乐观众。在每个週末晚上送上最新娱乐资讯，呈献集清谈、音乐、趣剧、游戏及资讯于一身的全新节目《今晚睇李》。 　　艺人李思捷为综艺节目《今晚睇李》做监制，并夥拍单立文担任节目主持。于每周日晚上10点播出。 　　思捷表示节目以外国深夜节目《Tonight Show》做蓝本，每集将邀请嘉宾来接受访问及玩游戏，当中更有两至三分钟的喜剧《思文败类》，问到会请甚麼嘉宾？他指会请歌手、演员谈心得：「因为未确定唔敢讲住，但预计会请贺岁片巨星。', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://20000|cf59373479063ae83ab73638e399febe050a0d11|今晚睇李[高清TV粤语]01.rmvb#第02集$jjhd://20000|7b0d2c4fc095d1aa811757c3b115a30846c23930|今晚睇李[高清TV粤语]02.rmvb#第03集$jjhd://20000|976d8314a0f3a81d15a3927277d7439c33f00071|今晚睇李[高清TV粤语]03.rmvb#第04集$jjhd://20000|a7ec8af3658f2e1f3c4d474349e4299a79ca5d81|今晚睇李[高清TV粤语]04.rmvb#第05集$jjhd://20000|098048c50bc57dd66889b3a2d8ab4da838c0d898|今晚睇李[高清TV粤语]05.rmvb#第06集$jjhd://20000|e6d294e84e11aaeb532593d6d767c1ff5b33c6e2|今晚睇李[高清TV粤语]06修正.rmvb#第07集$jjhd://20000|9d9593fd640af219894b915d180490e02a076bff|今晚睇李[高清TV粤语]07.mkv#第08集$jjhd://20000|17d5ccae1c5e31a171be01530a2f1c79819d8665|今晚睇李[高清TV粤语]08.rmvb#第09集$jjhd://20000|b4a4e059f34c72928a22279e4edf560113a3ee6c|今晚睇李[高清TV粤语]09.rmvb#第10集$jjhd://20000|0825c195006d31026081e4915eab033da6333795|今晚睇李HDTV0405.mkv#第11集$jjhd://20000|393211e90942a4a9f0ded3b075943247f812aed2|今晚睇李[高清TV粤语]11.rmvb#第12集$jjhd://20000|a7d48fdca87fda62591c989352fe5084a4e51e19|今晚睇李12.mkv#第13集$jjhd://20000|eb7cff981b1588a308b3a77ef810c7064fe0c6dd|今晚睇李HDTV0503.mkv#第14集$jjhd://20000|30855e2f9dcddb118268dc5b4d7aa3f9f3c4e3ed|今晚睇李[高清TV粤语]14.rmvb#第15集$jjhd://20000|4b893fa6a1051a7618043ab99c82042a9c3fa52a|今晚睇李[高清TV粤语]15.rmvb#第16集$jjhd://20000|63db85eafb7043a5b00d70e7f5236899aa178c34|今晚睇李HDTV0524.mkv#第17集$jjhd://20000|f9bb47ef2147f8d645582e9670d