INSERT INTO `mac_vod` VALUES ('32', 'Sunday靓声王', '', 'Sundayliangshengwang', 'S', '', 'http://img.jijizy.com/upload/vod/2015-06-15/20156151421077729.jpg', '', '', '汪明荃 郑少秋 林晓峰', '内详', '', '', '香港', '粤语', '2015', '3', '', '', '0', '0', '0', '18', '0', '0', '0', '0', '628', '0', '0', '0', '0', '0', '0', '7.0', '1225', '175', '1436186546', '1436186546', '0', '0', '大年初四，大街小巷都還播着賀年歌，《Sunday靚聲王》便不湊此熱鬧，但既然是過中國年，不如就唱國語歌！國語歌在香港發展的鼎盛時期當屬七十年代，那時無論是家家戶戶收音機播放的，還是人人口中哼唱的，皆是國語歌；不但如此，連徐小鳳、劉鳳屏、舒雅頌等本地紅歌星都轉唱國語歌！當年為國語金曲着過魔的觀眾請注意，收看今集節目可能令各位產生心跳加速、熱血沸騰等「不安」反應，甚至有再度着魔的「危險」！    當年台灣歌手各自有「朵」，男則「XX歌王」，女則「XX歌后」，憑一曲<蘋果花>俘虜歌迷心的楊燕，則被封為「蘋果花歌后」，「歌后」難得大駕光臨，豈有不送<蘋果花>之理？「國語靚聲」王馨平亦上台捧場，並與鄭少秋(秋官)合唱歌曲；而本地「靚聲」舒雅頌、呂珊、方伊琪、曾航生亦陸續奉送那些年「最hit」的國語金曲！    秋官也曾順應潮流，出過國語專輯，更赴台灣拍劇，而秋官母語並非國語，要他用國語唱歌、演戲可覺為難？據聞上集節目播出後，不少觀眾因未能聽到秋官演唱<楚留香>而失眠，秋官於心不忍，唯有在今集附贈該曲「補數」，供觀眾作「安眠」之用，祝大家新年日日有好夢', 'jjvod', '0', '', '第01集$jjhd://20000|56bb93e33f0e783465951282443cd03762fad2e9|Sunday靓声王[高清TV粤语]01.rmvb#第02集$jjhd://20000|6ae9d792007246ff699177a53279914075f3809f|Sunday靓声王[高清TV粤语]02.rmvb#第03集$jjhd://20000|f402d4cb2fd20ff84c8d2dc82a8d0216e0a1c7b4|Sunday靓声王[高清TV粤语]03.rmvb#第04集$jjhd://20000|3b974b96d769b5f183d8d0c1f59c622e71b55f66|Sunday靓声王[高清TV粤语]04.rmvb#第05集$jjhd://20000|eb4473a5ef29661d458e65997461d467b3e81dce|Sunday靓声王[高清TV粤语]05.rmvb#第06集$jjhd://20000|73b364e52992c921305baeabd7c5be0f685a9619|Sunday靓声王[高清TV粤语]06.rmvb#第07集$jjhd://20000|67cfaf5d73cc4c19e36d6c11e2b6d26655ee8633|Sunday靓声王[高清TV粤语]07.rmvb#第08集$jjhd://20000|c49ee1ebf131a6f7a56cc241c6a87ae78b326c62|Sunday靓声王[高清TV粤语]08.rmvb#第09集$jjhd://20000|60099711bb633bb60727b086cf41c3b751d8a08a|Sunday靓声王[高清TV粤语]09.rmvb#第10集$jjhd://20000|09f15a4f4c1d7886d4feffeb2bd44871e4226c42|Sunday靓声王[高清TV粤语]10.rmvb#第11集$jjhd://20000|d5b40fa206dafd1b999291d5da6fdb0c0cbe15f2|Sunday靓声王[高清TV粤语]11.rmvb#第12集$jjhd://20000|760b18e917bb682ea6128b337fac604c013d088c|Sunday靓声王[高清TV粤语]12.rmvb#第13集$jjhd://20000|9d6dad4e7ab4d1e610940eccbd40fbcade00b1e1|Sunday靓声王[高清TV粤语]13.rmvb#第14集$jjhd://20000|fe570151a37f84b807bb3e81b14