INSERT INTO `mac_vod` VALUES ('33', '花燃', '', 'huaran', 'H', '', 'http://img.jijizy.com/upload/vod/2015-01-12/20151129315348188.jpg', '', '', '井上真央 大泽隆夫', '渡邊良雄', '', '', '日本', '日语', '2015', '14', '', '', '0', '0', '0', '26', '0', '0', '0', '0', '584', '0', '0', '0', '0', '0', '0', '7.0', '2730', '390', '1436186546', '1436187128', '0', '0', '女星井上真央主演2015年的NHK大河剧《花燃》的消息3日正式公布，这是一部以幕末的长州藩士兼思想家吉田松阴的妹妹“文”为主人公的原创作品。这是井上第一次主演大河剧，也是自晨间剧《太阳公公》（2011年）后，久违四年加盟NHK剧集。当天，在NHK举行了制作发表会，井上表示：“有必须做功课的地方，我会带着责任去努力的”。 　　《花燃》刻画文嫁给长州藩的尊王攘夷派的中心人物久坂玄瑞，在后者去世后，与群马县第一位县令楫取素彦再婚，在动乱的年代坚强生活的故事。脚本由曾推出《一公升的眼泪》、《达令是外国人》等经典作的大岛由美和晨间剧《PIANO》、《七个会议》等作的宫村优子联合担当。', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://20000|ec7e3ba0ecaef2c47396f873d7edd2706a848954|花燃01.mp4#第02集$jjhd://20000|5237d1764c40bfc81c1ad50d98621cf1c68d8f4c|花燃02.mp4#第03集$jjhd://20000|79714ac19f6dfc5c2ce7baae0d3b549fb274891d|花燃[03].mp4#第04集$jjhd://20000|3a95548a0beb2415f94135950db32a15cf1a5cca|花燃04.mp4#第05集$jjhd://20000|a5753ccc2ecdb95a9bb3cf3de0184ca9b4a717e1|花燃05.mp4#第06集$jjhd://20000|e97725095afacbe6fea2e231de1bea1aaf784e20|花燃06.mp4#第07集$jjhd://20000|79b74d2c5556dc7933d4f80f22abf99794153868|花燃07.mp4#第08集$jjhd://20000|65d3c595767673fe16c11dcc08c983348726d935|花燃08.mp4#第09集$jjhd://20000|a0dc4541992259100d07ebf8899dc8563c369f9c|花燃09.mp4#第10集$jjhd://20000|5ee5a7a54b651fe4867dc9d74fd3632b2ce62238|花燃10.mp4#第11集$jjhd://20000|580be8c1d692075b268d4f46c42232ccd552aa7d|花燃11.mp4#第12集$jjhd://20000|41675c6dab203f8979d8f2b4c144ce65593e9408|花燃12.mp4#第13集$jjhd://20000|a011f03fff92d9fb7431a20078e3e6f84df90542|花燃13.mp4#第14集$jjhd://20000|f0c1d637a47da0d61644c5f9e1a81c3b06b649c2|花燃14.mp4#第15集$jjhd://20000|eb54cb6ad21d27d3eaeed2ab35ea9318a4fcd0e1|花燃15.mp4#第16集$jjhd://20000|9f22bc3b1128d2fa2a061a88b3e5d201e56e8995|花燃16.mp4#第17集$jjhd://20000|4bccea0c22a32021826f9944c7c3275cccdad266|花燃17.mp4#第18集$jjhd://20000|b83ccc8e9dc8368a0c2d38415f704d15a9f617f2|花燃18.mp4#第19集$jjhd://20000|e6003f39af1c15aa81a0d80a712c6abe59abbd84|花燃19.mp4#第20集$jjhd://20000|495b57e5d0ad4c8b47