INSERT INTO `mac_vod` VALUES ('35', '无心法师', '', 'wuxinfashi', 'W', '', 'http://img.jijizy.com/upload/vod/2015-07-6/20157610145920580.png', '', '', '韩东君  金晨   张若昀   陈瑶   王彦霖', '林玉芬   高林豹', '', '', '大陆', '国语', '2015', '12', '', '', '0', '0', '0', '1', '0', '0', '0', '0', '376', '0', '0', '0', '0', '0', '0', '3.0', '696', '232', '1436186546', '1436187137', '0', '0', '无心为不老不死之身。不老不死，一般都能牛逼得惊天动地，但搞不好可能穷困潦倒讨饭万年。很不幸，无心，是后者。 　　无心法师是位异人，永远不老，永远不死。他不知道自己从何处来，往何处去。流浪在无边无际的岁月长河中，他一边历险，一边恋爱。 　　为了追求爱情，他在同治年间带着恋人隐居山林。民国时代恋人老死， 而他因为穷得活不下去，只好伪装成和尚进入山下县城，找活路去了…', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://20000|e23381dadbf1463945640f619caed9dc0a2d1fa1|无心法师01.mp4$$$第01集$ftp://a.gbl.114s.com:20320/1147/无心法师01.mp4', '', '', '', '');
INSERT INTO `mac_vod` VALUES ('36', '为爱所困2', '', 'weiaisuokun2', 'W', '', 'http://img.jijizy.com/upload/vod/2015-05-3/201553212635555.jpg', '', '', '内详', '内详', '', '', '其他', '其他', '2015', '15', '', '', '0', '0', '0', '19', '0', '0', '0', '0', '970', '0', '0', '0', '0', '0', '0', '1.0', '301', '301', '1436186546', '1436187149', '0', '0', '讲述故事发生在星期五男校和邻近的星星女子修道院。Em是星星女子修道院的学生，他男友Pun是星期五男校学生会秘书长；而Yuri一直把男校音乐社的社长No当作男朋友，这四个人相互都认识。某天音乐社需要用社团经费购买一架鼓，可是发现社团经费和之前申请的数目不一致，于是急冲冲的去学生会办公室，希望重新核对下社团申请的活动经费，此刻见到的只有秘书长Pun，经过确认，由于在年度社团经费听证会上音乐社派出的人员失误导致了经费的变化，可是社团已经和老板联系好了，在关键时刻Pun对No说“如果你当我的男朋友 那么我就帮你”此时，No听到起，被吓到了…', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://20000|4605e35c37ee5151ceca1b276df1eb75bb621f01|为爱所困2-01.mkv#第02集$jjhd://20000|77827e996cfb349fb7b2a533cd4d7dcbebfd5a3f|为爱所困2-02.mkv#第03集$jjhd://20000|e5758f4796144edab51ae1384759b7cb17314e81|为爱所困2-03.mkv#第04集$jjhd://20000|dbbf59f8de3f74a2f68cffcdd6d2a53658b77607|为爱所困2-04.mkv#第05集$jjhd://20000|fa1d8f6c0ae314530590d20c2ab32b271df75967|为爱所困2-05.mkv#第06集$jjhd://20000|bdc8cc2af870823064785672ac883cc9465a3905|为爱所困2-06.mkv#第07集$jjhd://20000|fc31b0af25680ff9c908f0e933bbb9d4dfa0877c|为爱所困2》EP7.mkv#第08集$jjhd://20000|c9e8394faf7b3f8acf4e151d2608f84c4aed2f1a|为爱所困2》第八集.mkv#第09集$jjhd://20000|49611653f522cd9eab79bf211d9e8b8cc7fd86bc|为爱所困2-09.mkv#第10集$jjhd://20000|d48c6974850bbe0b77ac1263a7424ad44632e3cc|为爱所困2-10.mkv#第11集$jjhd://20000|6944db92e19e3f2aec70459eccaf04adf4120a42|为爱所困2-11.mkv#第12集$jjhd://20000|011fd77d3ef64e261f478417650e37df5cf421b2|为爱所困2-12.mkv#第13集$jjhd://20000|03c67fd866d5ce1af643267de489c49c3db7baba|为爱所困2-13.mkv#第14集$jjhd://20000|c77eddea4329ee19d7b8520341dde8d385faaa7e|为爱所困2-14.mkv#第15集$jjhd://20000|e368c49d67d7d1a1187e2545e795f2e53547e4d5|为爱所困2中字第十五集.mkv#第16集$jjhd://20000|ad5427add2888b70624c6a2c739c7c1e0002565a|为爱所困2-16.mkv#第17集$jjhd://20000|564d81ba99d9f6ed6652d89e148e1b44d3318bbb|为爱所困2-17.mkv#第18集$jjhd://20000|14c648e30fa2f50eb5fcfb2a64b6ed11a7f008a2|为爱所困2》EP18.mkv#第19集$jjhd://20000|40927e9c4601d15d31b55b14a107719683