INSERT INTO `mac_vod` VALUES ('40', 'RunningMan', '', 'RunningMan', 'R', '', 'http://img.jijizy.com/upload/vod/2014-05-5/2014552145399800.jpg', '', '', '刘在石 池石镇 金钟国', '内详', '', '', '韩国', '韩语', '2014', '3', '', '', '0', '0', '0', '20150705', '0', '0', '0', '0', '210', '0', '0', '0', '0', '0', '0', '3.0', '192', '64', '1436186553', '1436186553', '0', '0', '刘在石再次投入SBS的新娱乐节目《Running Man》的準备中，本次新节目从出演人物开始已经收到相当大的关注。 世界杯结束，将在7月首次放送《Running Man》，导致观众们好奇心的地方在于，刘在石和成员们没有空闲地跑动、洋溢着活跃的对决，展开独特概念的节目。 每周计划无论歌手、演员、笑星、运动员等领域作为新嘉宾出演。 《Running Man》固定成员除了包括池石镇、金钟国、HAHA外，还有因《穿透屋顶的high kick》被喜爱的李光秀、演员宋钟基，随同Hip-Hop二人组“Leessang”成员Gary一起，发觉潜藏的艺能感。', 'jjvod', '0', '', '20140518$jjhd://10160|7eda7f059a14541878766a47be18c91eadbfd982|Running Man_20140518.mkv#20140525$jjhd://10017|adcc2ae0aae82a0ff3468787b05c003c68a03a1e|RunningMan20140525.rmvb#20140601$jjhd://10123|e3ab7158df505736825e832ce8878516b25b8dea|Running man之20140601.flv#20140608$jjhd://10123|c5418aa763540bd688941172cb83ad305e07a421|Running Man 20140608.mp4#20140615$jjhd://10123|fc41ef5a7dd67dbde5f6b757bc85d915754b5b73|Running Man之20140615.flv#20140622$jjhd://10123|1c7052fc385f5f35207800fea73a13232abeb978|Running Man20140622.mp4#20140629$jjhd://10158|552fb3de82f1de0aaa69f8ab580e1cf87de73e33|RunningMan20140629.flv#20140706$jjhd://10158|8dc5789078413b7e1212581c1aa26b1476c151ca|Running Man20140706.flv#20140713$jjhd://20000|899def63758994b14e42430ee335f04abf8a4c8c|RunningMan20140713.mkv#20140720$jjhd://10158|c62ff54a7020144ae41e07eb64df5c07bf9914e7|running man之20140720.mkv#20140727$jjhd://20000|33ad401697c70f12d7c0258329460112d909152d|RunningMan20140727.mkv#20140803$jjhd://10123|1b0887372912ba87cd140abb1f1bb230ce729d89|Running Man之20140803.mkv#20140810$jjhd://10123|f03c3c6b841e448acdbd0640dc7f9c552bd46c0b|Running Man之20140810.mkv#20140817$jjhd://10158|c858206b00900f4b11e0d1ac41e40254f943e0b2|Running Man20140817.mkv#20140824$jjhd://10160|4f8c01a0089a5c047b246b7297c6dfb3d4c8ea83|Running Man之20140824.mkv#20140831$jjhd://20000|0abdf993e03f7cbb