INSERT INTO `mac_vod` VALUES ('41', '众神天堂第一季', '', 'zhongshentiantangdiyiji', 'Z', '', 'http://img.jijizy.com/upload/vod/2015-04-4/20154418413278403.jpg', '', '', '内详', '内详', '', '', '欧美', '英语', '2015', '15', '', '', '0', '0', '0', '13', '0', '0', '0', '0', '308', '0', '0', '0', '0', '0', '0', '5.0', '1895', '379', '1436186553', '1436187137', '0', '0', '13集神话改编剧《众神天堂》（Olympus）由当年开发迷你剧《爱丽丝梦游奇境》（Alice）和《铁皮人》（Tin Man）的原班人马打造，故事描述一小群勇敢的男女将众神驱逐到一个虚幻的空间——他们称之为「阴曹地府」或者「冥界王国」。故事的主人公是一个初出茅庐、乳臭未干的黄毛小子，在经历一系列起伏跌宕的故事之后，这个经受住背叛、爱情、失望和力量强化考验并最终遭到流放的年轻人以更强悍的态度回来了。他比以往任何时候更坚强、更无情、更强大，他成了人类的领袖并足以独自匹敌众神。', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://20000|9a0ef452fbddd4dc03b108abcf2b6f7a48fcf56a|众神天堂S01E01.mp4#第02集$jjhd://20000|2f305115008d4a44084cc92a97454c6a5b136cdb|众神天堂第一季02.mp4#第03集$jjhd://20000|1f84cbabddd45a2bb4710dc78f8d28f4e6096046|众神天堂第一季03.mp4#第04集$jjhd://20000|5169a8aa491edaa97e0e56ad4428b57acc5ff520|众神天堂第一季04.mp4#第05集$jjhd://20000|5a5b96cfd49a849a32d0b145f147470cdfc4e706|众神天堂S01E05.mp4#第06集$jjhd://20000|83d97ad4b5879bcc875d4b4b413e5834869d9c33|众神天堂S01E06.mp4#第07集$jjhd://20000|d73b1e9646e7e51ca21b2983e0fbdd1ff61faaca|众神天堂第一季07.mp4#第08集$jjhd://20000|3b148492fa0a02a5ad13924e0e480eb25c83365f|众神天堂S01E08.mp4#第09集$jjhd://20000|1fc25ce8d771cf0cc05ae0dfda1cc651b17a63a0|众神天堂S01E09.mp4#第10集$jjhd://20000|af76474e593ce2acf9010e772b85a36a94362e90|众神天堂第一季10.mp4#第11集$jjhd://20000|441cad2ccf19cdd8c330a5b92303646a860c5eb3|众神天堂第一季11.mp4#第12集$jjhd://20000|6817e0d9daade59dce49527e482386609a3578e3|众神天堂第一季12.mp4#第13集$jjhd://20000|47f3005b7e0d49a8188390f7e3f51045415d9339|众神天堂第一季13.mp4$$$第01集$ftp://a.gbl.114s.com:20320/2005/众神天堂第一季01.mp4#第02集$ftp://a.gbl.114s.com:20320/7635/众神天堂第一季02.mp4#第03集$ftp://a.gbl.114s.com:20320/9073/众神天堂第一季03.mp4#第04集$ftp://a.gbl.114s.com:20320/5445/众神天堂第一季04.mp4#第05集$ftp://a.gbl.114s.com:20320/6842/众神天堂第一季05.mp4#第06集$ftp://a.gbl.114s.com:20320/8453/众神天堂第一季06.mp4#第07集$ftp://a.gbl.114s.com:20320/9711/众神天堂第一季07.mp4#第08集$ftp://a.gbl.114s.com:20320/5782/众神天堂第一季08.mp4#第09集$ft