INSERT INTO `mac_vod` VALUES ('42', '他看她的第2眼', '', 'takantadedi2yan', 'T', '', 'http://img.jijizy.com/upload/vod/2015-05-31/201553123395048293.jpg', '', '', '刘以豪 魏蔓 趙杰', '陈嘉鸿', '', '', '台湾', '国语', '2015', '13', '', '', '0', '0', '0', '6', '0', '0', '0', '0', '572', '0', '0', '0', '0', '0', '0', '2.0', '668', '334', '1436186553', '1436187128', '0', '0', '《他看她的第2眼》（英语：When I See You Again），2015年三立华人电视剧周日十点档系列的第三十五部作品。由刘以豪、魏蔓、趙杰、邵雨薇领衔主演。于2015年5月12日开镜，台视于5月31日晚上10点首播，三立都会台于6月6日晚上10点播出。接档《听见幸福》。 　　“他的心里到底在想什么？”这是每个人都很在意的问题 　　他，夏又谦（刘以豪 饰） 擅长观察别人细微的动作、表情；利用第一眼看透别人的精准度极高 只是 ，爱情往往是盲目的，不是一眼就能看穿… 　　她，安希（魏蔓 饰） 看到她的第一眼，总是会被吓到，但只要和她相处过后，绝对让你难忘… 　　第一次相遇，她是个校园女霸王，他是衰尾道人一字眉。 第二次相遇，她成了民宿万事包，他则是白手起家成功人士。 　　当总是用第一眼看人的男主角 遇上看第二眼才能看见她的好的女主角时，会冲撞出什么火花呢？', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://20000|f63f69dada55d2a5c9ec25143736282f9e8b0cb5|他看她的第二眼TV01.mkv#第02集$jjhd://20000|57aa13237bda41fea17dcb6e908ee69fd797376c|他看她的第2眼TV02.rmvb#第03集$jjhd://20000|710fc55e8d4dd564acda1a070b4b5e578f2da49e|他看她的第2眼-03.rmvb#第04集$jjhd://20000|71533be8c39821289fb89f3ff4499cbb5b4470d8|他看她的第2眼TV04.rmvb#第05集$jjhd://20000|2406ad85677ea0688123f45c7d49eb817e5f5fc2|他看她的第2眼-05.rmvb#第06集$jjhd://20000|be295dca32fddfadb82264cc6cd292b2b1b65550|他看她的第2眼-06.rmvb$$$第01集$ftp://a.gbl.114s.com:20320/8138/他看她的第二眼TV01.mkv#第02集$ftp://a.gbl.114s.com:20320/3072/他看她的第2眼TV02.rmvb#第03集$ftp://a.gbl.114s.com:20320/2500/他看她的第2眼TV03.rmvb#第04集$ftp://a.gbl.114s.com:20320/5073/他看她的第2眼TV04.rmvb#第05集$ftp://a.gbl.114s.com:20320/6653/他看她的第2眼TV05.rmvb#第06集$ftp://a.gbl.114s.com:20320/9527/他看她的第2眼TV06.rmvb', '', '', '', '');
