INSERT INTO `mac_vod` VALUES ('44', '7个朋友', '', '7gepengyou', '7', '', 'http://img.jijizy.com/upload/vod/2015-05-31/201553111592973484.jpg', '', '', '付辛博 陈奕 沈建宏  唐振刚  刘忻 任容萱 傅颖', '内详', '', '', '台湾', '国语', '2015', '13', '', '', '0', '0', '0', '12', '0', '0', '0', '0', '284', '0', '0', '0', '0', '0', '0', '9.0', '2214', '246', '1436186553', '1436187137', '0', '0', '七个朋友全集,七个朋友在线观看.年少冲动的阿泽和心高气傲的Abel，在他俩17岁的那年，因为同时爱上心彤而结下仇恨，两个人自此后水火不相容，更是见不得对方的存在，经常爆发剧烈的冲突，三个人在毕业后都不得不面对社会的压力，他们各自东西，形如陌路。很快就七年之后了，在网路作家结人的偶然撮合之下，三个人有一次意外的相逢，但过去的疙瘩还没有解开，三个人又彼此纠缠在了一起。Abel此时已经变成心彤的上司了，他为了当年的事情公报私仇，要求心彤签下了一份无理特殊的合同，实则为友情契约，这也让心彤从此无法在摆脱他，这份合同成了阿泽、Abel、心彤三个人之间战争的导火线，但是结人最无辜，虽然他被牵扯进来，不过还有更无辜的人被拉进来了，比如心彤的同事们，明勋、娜娜、还有阿泽的死党哥们叶子，这一群人卷进了这个漩涡之中，让几个人的爱情、友情在恩怨中发展出一段段复杂离奇的情感故事。', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://20000|3b156e4479bd7813622928310ee4403b612c7a8a|7个朋友-01.rmvb#第02集$jjhd://20000|abb8e551902bdcd1dc3bdc6b48347b76bb824466|7个朋友-02.rmvb#第03集$jjhd://20000|40d0e8fc6fa5bae530b5b50d63cf3f19ba923df8|7个朋友-03.rmvb#第04集$jjhd://20000|a661f3bc1db92408dbadb77929be96111ecb5614|7个朋友-04.rmvb#第05集$jjhd://20000|4c64fb15b4e2071bfe42dbcdc6bc4f6a95e59c11|7个朋友-05.rmvb#第06集$jjhd://20000|dae2d0786eefa85bf2a08eab1e8ec83f338b975b|7个朋友-06.rmvb#第07集$jjhd://20000|752fc74aff420e33d338ef3de920a9f68fd22816|7个朋友-07.rmvb#第08集$jjhd://20000|4ce7d34f96b758797ba16ef7fc1a0fae13a2d8e7|7个朋友-08.rmvb#第09集$jjhd://20000|08d60b68dace4f8d989c729c7381449df5e4f8c2|7个朋友-09.rmvb#第10集$jjhd://20000|53c37285561de90ccdd80b61b3172332565a4edf|7个朋友-10.rmvb#第11集$jjhd://20000|ba73878804a13fe78d76160e54fbcbf73c689043|7个朋友-11.rmvb#第12集$jjhd://20000|af11f0c2af2297fc66f27bf40b29f8b2df3cf756|7个朋友-12.rmvb$$$第01集$ftp://a.gbl.114s.com:20320/7250/7个朋友-01.rmvb#第02集$ftp://a.gbl.114s.com:20320/6283/7个朋友-02.rmvb#第03集$ftp://a.gbl.114s.com:20320/0470/7个朋友-03.rmvb#第04集$ftp://a.gbl.114s.com:20320/9620/7个朋友-04.rmvb#第05集$ftp://a.gbl.114s.com:20320/8192/7个朋友-05.rmvb#第06集$ftp://a.gbl.114s.com:20320/8769/7个朋友-06.rmvb#第07集$ftp://a.gbl.114s.com:20320/8948/7个朋友-07.rmvb