INSERT INTO `mac_vod` VALUES ('48', '乱入乾坤', '', 'luanruqiankun', 'L', '', 'http://img.jijizy.com/upload/vod/2015-07-3/20157312513058637.jpg', '', '', '雍乾坤 张玮玮 季家驹 刘儒金', '季家驹', '', '', '大陆', '国语', '2015', '12', '', '', '0', '0', '0', '6', '0', '0', '0', '0', '272', '0', '0', '0', '0', '0', '0', '7.0', '819', '117', '1436186553', '1436187137', '0', '0', '三十二岁的无业青年帅坤决定不再等待机遇从天而降，主动向职场发起挑战，开始了一场华丽职场冒险。他不断遭遇奇葩同事，刁钻客户，职场黑幕，但他不服输，不放弃，坚持真理，爱憎分明，和一切不合理现象作斗争，然后失业。20份工作，20次努力，他屡败屡战，带着执着与信念，在人生路上跌跌撞撞，追求成功的梦想！', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://20000|482973ce51c939e746aa70f8e5f2d1c86484dae3|乱入乾坤01.mp4#第02集$jjhd://20000|432fb764b9a99bcd9472d097d4e60f32bdb2b3cd|乱入乾坤02.mp4#第03集$jjhd://20000|45fcdb219847e5a7fef31ef8438f64b90648163a|乱入乾坤03.mp4#第04集$jjhd://20000|b42a149e2cc683634f7db87895d50dbacbb909e8|乱入乾坤04.mkv#第05集$jjhd://20000|bcdab138c17bbb3410e220e2527453b0d3cc4c5e|乱入乾坤05.mkv#第06集$jjhd://20000|8253ca9253010f68cdfee80b8173a9085f9e3269|乱入乾坤06.mkv$$$第01集$ftp://a.gbl.114s.com:20320/5738/乱入乾坤01.mp4#第02集$ftp://a.gbl.114s.com:20320/9591/乱入乾坤02.mp4#第03集$ftp://a.gbl.114s.com:20320/6555/乱入乾坤03.mp4#第04集$ftp://a.gbl.114s.com:20320/0006/乱入乾坤04.mp4#第05集$ftp://a.gbl.114s.com:20320/0296/乱入乾坤05.mp4#第06集$ftp://a.gbl.114s.com:20320/9381/乱入乾坤06.mp4', '', '', '', '');
INSERT INTO `mac_vod` VALUES ('49', '爱情不打烊', '', 'aiqingbudayang', 'A', '', 'http://img.jijizy.com/upload/vod/2015-03-23/201532319342343381.jpg', '', '', '黄少祺 陶昕然 李金铭 张庆庆 林韦君', '陈俊任 连春利', '', '', '大陆', '国语', '2015', '12', '', '', '0', '0', '0', '38', '0', '0', '0', '0', '945', '0', '0', '0', '0', '0', '0', '3.0', '699', '233', '1436186553', '1436187137', '0', '0', '《爱情不打烊》改编自2010年台湾热播剧《家和万事兴》。 　　90年代初，赵渊铭、沈孟怀、孙伟涛三兄弟，合伙赚了第一桶金，沈孟怀突遭车祸而死，其妻林美婵认定赵孙所为，三家因此反目成仇。二十四年后，赵、孙两家的子女赵小芸和孙靖晨偷偷相爱，随着一位叫沈晓君的女孩出现，两人关系被曝光。双方父母的反对，沈晓君的介入，与靖晨之间的误会，都没让赵小芸放弃感情。不料，命运弄人，沈晓君竟是自己同父异母的姐姐。沈晓君原不知自己真实身份，是被母亲林美婵教唆冒名而来，意在搅乱赵孙两家，欲报家仇。当自己身世之谜被揭开，她记恨养母。了解林美婵的仇恨根源后，赵、孙两家当面解开了三家多年的心结，真相揭开，林美婵幡然醒悟，悔不当初。当三家和好如初，有如福星临门，化干戈成为玉帛，人情温暖人心。子承父业，这三家孩子们用美好的爱情友情浇注崭新的公益事业，走向辉煌。', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://10034|20cdfaea8f154934e6150f0d9cc230d2498a8aff|爱情不打烊01.mkv#第02集$jjhd://10034|491aae1c7e0527def567d375177c42d1407fedcb|爱情不打烊02.mkv#第03集$jjhd://20000|5674b9a1536fdd288cf9c9dbc8cc70e56d4c7976|爱情不打烊 03_高清.mp4#第04集$jjhd://20000|75997c8758dff5b461c0ae3e7bc729866c752d9c|爱情不打烊 04_高清.mp4#第05集$jjhd://20000|5f012195a56dbd9ac28fc603ee1d88e8e7054459|爱情不打烊 05_高清.mp4#第06集$jjhd://20000|416f0bba78b8e7024885a7db231b6dc84bd1610f|爱情不打烊 06_高清.mp4#第07集$jjhd://20000|05526c5e0337175a37752d3e6a3fe90d0460afdb|爱情不打烊 07_高清.mp4#第08集$jjhd://20000|ae878251c4cf1e568db67de56b7897d43079a947|爱情不打烊 08_高清.mp4#第09集$jjhd://20000|453937815f649f7a7d80d69b9065ed4c3c5f5389|爱情不打烊 09_高清.mp4#第10集$jjhd://20000|e9cc18cabfff7fceafa131195d4b5ec9b1d4af21|爱情不打烊 10_高清.mp4#第11集$jjhd://20000|008869c7a56d2f39dbf9bc3cccb506581f31372e|爱情不打烊 11_高清.mp4#第12集$jjhd://20000|6a04640ea836cb515fdb26533faa884882de13cf|爱情不打烊 12_高清.mp4#第13集$jjhd://20000|6e3102f2fb783ec35379c7f79608a10de9d598ca|爱情不打烊 13_高清.mp4#第14集$jjhd://20000|2823317636e32c97beff9a8ab6974c88938bfc52|爱情不打烊 14_高清.mp4#第15集$jjhd://20000|125a9bae9e251cbe126a977bca3d11f09253feb0|爱情不打烊 15_高清.mp4#第16集$jjhd://20000|7e6ab384f195212536f3ab3a1c340d9a9ffd0c6f|爱情不打烊 16_高清.mp4#第17集$jjhd://20000|1485d13d3ddb099b9e