INSERT INTO `mac_vod` VALUES ('50', '江户盗贼团·双雄', '', 'jianghudaozeituanshuangxiong', 'J', '', 'http://img.jijizy.com/upload/vod/2015-06-14/201561413432355823.jpg', '', '', '早乙女太一 成宮寛貴 菜々緒 田口浩正', '入江悠', '', '', '日本', '日语', '2015', '14', '', '', '0', '0', '0', '4', '0', '0', '0', '0', '111', '0', '0', '0', '0', '0', '0', '1.0', '358', '358', '1436186553', '1436187137', '0', '0', '弁藏（松山健一饰）和宗次（早乙女太一饰）在八王子的飞脚问屋工作，不过他们的真实身份却是名为赤目盗贼团的成员，每晚潜入恶人府邸，劫富济贫。某天，赤目的头领辰五郎突然去世，临终前留言将盗贼团托付给二人。然而，辰五郎的遗嘱中却将甚三郎（成宫宽贵）任命为下一任头领。甚三郎更与辰五郎遗孀阿绀（菜菜绪饰）有着千丝万缕的暧昧关系。因不满甚三郎剥削贫民的作风而与其决裂的二人，离开赤目，决意与甚三郎周旋到底.', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://20000|0aaeb5886803d9be3f95a285153c8b157203745c|江户盗贼团·双雄01.mp4#第02集$jjhd://20000|1db31cd02c4177e40e84dabbb100f782128bbe7f|江户盗贼团·双雄02.mp4#第03集$jjhd://20000|21545dd6e414bf23607f9cc6425a4bd2d089696d|江户盗贼团·双雄03.mp4#第04集$jjhd://20000|2406ad85677ea0688123f45c7d49eb817e5f5fc2|江户盗贼团·双雄04.mp4$$$第01集$ftp://a.gbl.114s.com:20320/3067/江户盗贼团·双雄01.mp4#第02集$ftp://a.gbl.114s.com:20320/7386/江户盗贼团·双雄02.mp4#第03集$ftp://a.gbl.114s.com:20320/7758/江户盗贼团·双雄03.mp4#第04集$ftp://a.gbl.114s.com:20320/6298/江户盗贼团·双雄04.mp4', '', '', '', '');
