INSERT INTO `mac_vod` VALUES ('52', '星座爱情双鱼女', '', 'xingzuoaiqingshuangyunv', 'X', '', 'http://img.jijizy.com/upload/vod/2015-06-22/20156221293594441.jpg', '', '', '谢坤达 蔡黄汝 林辰唏', '林敏祥', '', '', '台湾', '国语', '2015', '13', '', '', '0', '0', '0', '3', '0', '0', '0', '0', '722', '0', '0', '0', '0', '0', '0', '6.0', '2436', '406', '1436186553', '1436187128', '0', '0', '《雙魚座真命天子加S》，2015年臺灣偶像劇。本劇為《星座愛情系列》第三部曲，接檔《星座愛情獅子女》，由蔡黃汝、林辰唏、李妍憬、謝坤達、大飛、民雄領銜主演。民視於2015年6月21日晚上十點首播，東森綜合台於2015年6月27日晚上十點首播。', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://20000|220f61428cf1515612bdbae9fb88c864a2edefcc|星座爱情双鱼女TV01.rmvb#第02集$jjhd://20000|551c7c1cbbe511aef585756dd8eac8c5676731cb|星座爱情双鱼女-02.rmvb#第03集$jjhd://20000|c1e8047daacc09520223328f6902d175727ecb47|星座爱情双鱼女-03.rmvb$$$第01集$ftp://a.gbl.114s.com:20320/5351/星座爱情双鱼女TV01.rmvb#第02集$ftp://a.gbl.114s.com:20320/1481/星座爱情双鱼女TV02.rmvb#第03集$ftp://a.gbl.114s.com:20320/8984/星座爱情双鱼女TV03.rmvb', '', '', '', '');
