INSERT INTO `mac_vod` VALUES ('83', '你的传奇之危机四伏', '', 'nidechuanqizhiweijisifu', 'N', '', 'http://img.jijizy.com/upload/vod/2015-06-25/201562520153857430.jpg', '', '', '朱泳腾  张殿伦  陆之瑞  曹洋', '黄伟杰', '', '', '大陆', '国语', '2015', '12', '', '', '0', '0', '0', '21', '0', '0', '0', '0', '652', '0', '0', '0', '0', '0', '0', '7.0', '1596', '228', '1436186570', '1436186570', '0', '0', '剧情讲述了1931年，日本侵占中国东北三省，东北的沦陷令全国同胞痛心不已，全国各地掀起了一场场热烈的抗日爱国思潮。在武术之乡河北沧州，神州武馆的武术宗师叶宗寿深谙民族大义，他痛恨日本侵华，一心致力于为东北抗日武装捐赠，叶宗寿独门秘制治伤灵药“金创散”，却不想金创散的神奇疗效引起了日本关东军的高度重视。不久后叶宗寿遭人暗杀，在丧礼上遗嘱公开，叶宗寿把武馆交给了爱徒魏鸿生，并且将金创散的药方一分为二给魏鸿生和长子叶善群一。原本两家水火不容，各自拿着一半药方继续制药，只可惜药效远不如从前。日本人山本、中村勾结警察局局长杨士轩企图夺取药方，最后叶、魏两家为了守住中国人自己的药方终于团结起来一致对外，和日本人进行了一场正义与邪恶的生死较量，最终将山本击毙，中村等落荒而逃，杨士轩也得到应有的惩罚。', 'jjvod', '0', '', '第01集$jjhd://30456|278b382f188c6cc65cf6f642dbcbfe6fc36d9834|你的传奇之危机四伏001.mp4#第02集$jjhd://30456|78bc8e54ee8ad988b6b184ad545c56e6887b07a6|你的传奇之危机四伏002.mp4#第03集$jjhd://30456|5368bbf93df632bfaf07f0a8d77931c0d37b6778|你的传奇之危机四伏003.mp4#第04集$jjhd://30456|5e523fccdc27447ce749b5c67a8dd8d2550adc8c|你的传奇之危机四伏004.mp4#第05集$jjhd://30456|db1a0f3f3e57e51f638020ce56856b18fb3bb504|你的传奇之危机四伏005.mp4#第06集$jjhd://30456|aac7eacfa18cd821d316aff646eb8435e7ea9544|你的传奇之危机四伏006.mp4#第07集$jjhd://30456|238d7beed9d4631a3a420dccd35022226192451a|你的传奇之危机四伏007.mp4#第08集$jjhd://30456|6949a26b0eb7f6db632c7e68cf9066529ce7967b|你的传奇之危机四伏008.mp4#第09集$jjhd://30456|d472008eb72e5ecad0f6c2e9ed37162a04575efd|你的传奇之危机四伏009.mp4#第10集$jjhd://30456|08d0f5941643a55b4007f6d6326cf7a72cfbfc91|你的传奇之危机四伏010.mp4#第11集$jjhd://30456|d13d7fc1f23950b61552c6493bcf3eed8626997a|你的传奇之危机四伏011.mp4#第12集$jjhd://30456|ae06ec86cb679078ee1b560b00999cb4e06bd798|你的传奇之危机四伏012.mp4#第13集$jjhd://30456|96a2b44f69dbb4e663184a814a7d86efc48b443e|你的传奇之危机四伏013.mp4#第14集$jjhd://30456|d24362eef4a4d5eca7ba95d496e3d644f28dca0f|你的传奇之危机四伏014.mp4#第15集$jjhd://30456|2ff12e0abd769d17fdb71b450b09886852a7b8fb|你的传奇之危机四伏015.mp4#第16集$jjhd://30456|2ac268d4951b67b6dfa724d8abac9225f384a024|你的传奇之危机四伏16.mp4#第17集$jjhd://30456|c79e8e72357f7b41c4e0b0