INSERT INTO `mac_vod` VALUES ('84', '橙色密码', '', 'chengsemima', 'C', '', 'http://img.jijizy.com/upload/vod/2015-06-17/201561721132516911.jpg', '', '', '张倬闻 徐熙颜 李宗翰 巩汉林', '周小兵', '', '全集', '大陆', '国语', '2015', '12', '', '', '0', '0', '0', '53', '0', '0', '0', '0', '911', '0', '0', '0', '0', '0', '0', '2.0', '534', '267', '1436186570', '1436186570', '0', '0', '民国时期的上海租界,唐仁和马雅从德国警校学成归来，面对腐败黑暗的现实，一对青梅竹马的情侣选择了不同道路。知难而进的马雅进了警局，成为侦缉骨干。刚正不阿的唐仁，选择了私人侦探为职业。唐仁受朋友易 盏灯之托调查命案，却奇怪地陷入了精神分裂的状态。在马雅帮助下，唐仁回忆起多年前唐家与何润玉争夺宝藏的往事，二人携手战胜了觊觎我国宝的东洋势力，保住了国宝。古董商人夏三秋赴沪查寻传家宝玲珑鼎，遭到日本特务盯梢。唐仁受聘于夏三秋，却意外地成为杀害他的嫌疑人。易盏灯和马雅为唐仁洗刷了罪名，三人群策群力，最终找到玲珑鼎，粉碎了日本人盗取国宝的阴谋。此后，唐仁和马雅联手，勇于挑战黑暗，竭诚竭力竭智，陆续侦破了诸多奇案，成为一心为民除害的法治平民英雄。两人的情感历程，为那个灰蒙蒙的时代投射下一缕亮丽耀眼的阳光 。', 'jjvod', '0', '', '第01集$jjhd://30456|36f51a8bb6cd3a5eede12f4224cf1d80351a3f04|橙色密码001.mp4#第02集$jjhd://30456|641e25f54f2d104cb77b388b938f35f67e5525e7|橙色密码002.mp4#第03集$jjhd://30456|637ca7d92f8990d2f51c23730106b8f2c69955d8|橙色密码003.mp4#第04集$jjhd://30456|773b968bd24133bcd513698a3e8fda66e4c1d67f|橙色密码004.mp4#第05集$jjhd://30456|9b2e2a29a2e3898106610bd8a313ed9fbd25f2d6|橙色密码005.mp4#第06集$jjhd://30456|fe4a9d5935052f3b6624c2691588f4e8e3e6a587|橙色密码006.mp4#第07集$jjhd://30456|87bde99a655e6f092c9dc13994a6a24dea63f374|橙色密码007.mp4#第08集$jjhd://30456|2d103d8f9be2ba1de850c8b4500736fc930ec79f|橙色密码008.mp4#第09集$jjhd://30456|75227a8055d68f13334a3400eb3f7830e50b2da9|橙色密码009.mp4#第10集$jjhd://30456|77af1ed884a2f54073d1fe16dbc0c460765c0c56|橙色密码010.mp4#第11集$jjhd://30456|a7e6d60ebfd587972fa1ca5e43660f86b34ce58b|橙色密码011.mp4#第12集$jjhd://30456|7ca9c65a3d7cc5421994e01d7868158c4304b257|橙色密码012.mp4#第13集$jjhd://30456|dae346c5b6fc4feed574956318f7181fa3c03cc9|橙色密码013.mp4#第14集$jjhd://30456|3009b62e29273363409c5f76c750c5f94efa47fc|橙色密码014.mp4#第15集$jjhd://30456|3e429cab09685ed6cc7a4bde4a940c1d9afe7ae6|橙色密码015.mp4#第16集$jjhd://30456|580248c009a801ebe1839b893ef37f899843a80e|橙色密码016.mp4#第17集$jjhd://30456|71531a85e41a6ce79d1718bbf6333a6f0695b6b2|橙色密码017.mp4#第18集$jjhd://30456|06653278483fe6823f8427a6967c6291475ac712|橙色密码