INSERT INTO `mac_vod` VALUES ('85', '真实的人类第一季', '', 'zhenshiderenleidiyiji', 'Z', '', 'http://img.jijizy.com/upload/vod/2015-06-15/201561518184621686.jpg', '', '', 'Andreas Wilson Lisette Pagler', 'Harald Hamrell', '', '', '欧美', '英语', '2015', '15', '', '', '0', '0', '0', '4', '0', '0', '0', '0', '973', '0', '0', '0', '0', '0', '0', '5.0', '2180', '436', '1436186570', '1436186570', '0', '0', '本剧是由瑞典国家电视台拍摄于2012年的电视剧，讲述了人与机器人的纠葛，反映了人对待机器人的态度，以及进化后的机器人对人类的态度。体现了人类贪婪的本性。', 'jjvod', '0', '', '第01集$jjhd://20000|b25ecc77e49ba6d461fb3c33e413d5bd9ad26610|真实的人类S01E01.mp4#第02集$jjhd://20000|b21673b28a88b025004267b830d5b289db07e6e5|真实的人类第一季02.mp4#第03集$jjhd://20000|c9667fb2b583a7006e6ee90130f1301546094a9c|真实的人类第一季[3].mp4#第04集$jjhd://20000|50c13ba46494ac77475059a5ba91e82c96c6d841|真实的人类第一季04.mp4', '', '', '', '');
INSERT INTO `mac_vod` VALUES ('86', '殊死七日', '', 'shusiqiri', 'S', '', 'http://img.jijizy.com/upload/vod/2015-07-5/2015750174822422.jpg', '', '', '管梓净 吴健 田璐菡', '张彤 雷正彪', '', '', '大陆', '国语', '2015', '12', '', '', '0', '0', '0', '7', '0', '0', '0', '0', '418', '0', '0', '0', '0', '0', '0', '3.0', '555', '185', '1436186570', '1436186570', '0', '0', '1943年秋，日伪苏城清乡总指挥李世林因侵吞军饷败露，被日军毒杀。李的亲信秘书戴遂昌侥幸躲过捕杀，逃跑途中被我新四军武工队在我湖山根据地擒获。由于戴遂昌掌握了日军在苏城地区的军事部署和日伪与国民党顽固派暗中勾结的证据，军分区命令我湖山县委务必保证戴的安全，三天后派部队来转移戴遂昌。日军苏城宪兵司令部派出秘密行动组潜入湖山追捕戴遂昌；国民党顽固派恐其与日伪勾结的阴谋败露，秘令苏城特派员顾维民全力营救戴遂昌，营救不成则秘密除掉；而潜伏在湖山的日伪内奸也受命启动。我湖山县委保卫科长沈英杰受命保护戴遂昌，他和他的战友在三天中与日军、国民党顽固派和潜伏的日伪内奸展开了一系列惊心动魄的搏杀，最终完成了任务。', 'jjvod', '0', '', '第01集$jjhd://30456|4e66058a20a273248e0f9972004f5b941434011b|殊死七日HDTV01.mp4#第02集$jjhd://30456|9147019fbbd97dd01e4919fcbbc5694af120d31c|殊死七日HDTV02.mp4#第03集$jjhd://30456|1f76b373bb58e1a7a4632124b9750429ff3ffe82|殊死七日HDTV03.mp4#第04集$jjhd://30456|fe644dba89014e3f025411912271e4759301c58b|殊死七日HDTV04.mp4#第05集$jjhd://30456|4f257fc580e6af00569a0166ab97572ff3fc7d1a|殊死七日HDTV05.mp4#第06集$jjhd://30456|30f4249a2bb67adbf8031575534519555019c9ec|殊死七日HDTV06.mp4#第07集$jjhd://30456|d55f37eedb399b05a24c800b160877b43696fb79|殊死七日HDTV07.mp4', '', '', '', '');
INSERT INTO `mac_vod` VALUES ('87', '民兵康宝', '', 'minbingkangbao', 'M', '', 'http://img.jijizy.com/../2015-06-15/201561523101123048.jpg', '', '', '瞿旋 吴薇 周唯 张文亮', '宋海波 朴柱天', '', '', '大陆', '国语', '2015', '12', '', '', '0', '0', '0', '28', '0', '0', '0', '0', '174', '0', '0', '0', '0', '0', '0', '1.0', '382', '382', '1436186570', '1436186570', '0', '0', '抗日战争初期，侵华日军对我抗日根据地进行疯狂扫荡，实施“杀光、抢光、烧光”的三光政策。康家庄年轻村民康宝以在反扫荡中壮烈牺牲的哥哥为榜样，立志成为民兵英雄。在区委书记秦钟的教导下以独特的草根式的斗争方式，一次次与日军军官本田进行着殊死的较量。在经历了日军屠村，失去亲人和队友的惨痛考验之后，康宝出色的完成了上级交给的战斗任务，成功营救了失事的国军飞行员，赢得了众人由衷的敬佩和尊重。成功组建起了康家庄民兵队，并得到了进步青年杨晓棠的真挚爱情。', 'jjvod', '0', '', '第01集$jjhd://30456|4b3d5c0142bfffb8477143f1148b574b83d926f8|民兵康宝01完整版.mp4#第02集$jjhd://30456|0db4c82943cc618fef131ac98eb6ee159341e9b3|民兵康宝02完整版.mp4#第03集$jjhd://30456|fcff76a5421730a0de958fb8d741ef7b10c5b153|民兵康宝03完整版.mp4#第04集$jjhd://30456|e823285b47cf1494291218514430dcb634fd5e0c|民兵康宝04完整版.mp4#第05集$jjhd://30456|d06fe17f35d5b1365c5bb40ef1f42b253291f246|民兵康宝05完整版.mp4#第06集$jjhd://30456|7878abde70310699310aa5de1bff4ed3939aedfa|民兵康宝06完整版.mp4#第07集$jjhd://30456|63f8fbd9a229d7902a94a4a65385905ebad0bcaa|民兵康宝07完整版.mp4#第08集$jjhd://30456|26fd6006336df6ae00337ef6ecbfd9dd2329cd49|民兵康宝08完整版.mp4#第09集$jjhd://30456|379acf7158f3d71610f9a910ecf626b512f3a6bd|民兵康宝09完整版.mp4#第10集$jjhd://30456|ab42b5ecb958cb90f52ede1f447c6c20c57f9b80|民兵康宝10完整版.mp4#第11集$jjhd://30456|0e6c7b20eccc80331d1109a6c263d80e481bcc5c|民兵康宝11完整版.mp4#第12集$jjhd://30456|795a09a3315f0f3351223a4270c9a00f3d12a052|民兵康宝12完整版.mp4#第13集$jjhd://30456|aaf93ca8783b411796424d00391bfdbcc29ff33a|民兵康宝13完整版.mp4#第14集$jjhd://30456|9777ff317a3faaa493fb2651a4b5957c2e1efc09|民兵康宝14完整版.mp4#第15集$jjhd://30456|bab32fcd5d5d287ef7e9e4c9cf194061e166e502|民兵康宝15完整版.mp4#第16集$jjhd://30456|70e69dda61c620032dc2d9dafaf9297c945bb428|民兵康宝16完整版.mp4#第17集$jjhd://30456|cf2f1a755475ec4e4ef5ac8ccdcca889bbada94c|民兵康宝17完整版.mp4#第18集$jjhd://30456|e5e6e7b17dad350315597fafd3a6c52f3bfeddbc|民兵康宝18完整版.mp4#第19集$jjhd://30456|08ff4167160f395e7dfde35d99d1997b8cf5d11b|民兵康宝19完整版.mp4#第20集$jjhd://30456|