INSERT INTO `mac_vod` VALUES ('88', '同门往事', '', 'tongmenwangshi', 'T', '', 'http://img.jijizy.com/upload/vod/2015-06-26/201562623361712195.jpg', '', '', '贾一平 孙玮 邵峰 夏侯琪誉 李艳', '内详', '', '全集', '大陆', '国语', '2015', '12', '', '', '0', '0', '0', '32', '0', '0', '0', '0', '759', '0', '0', '0', '0', '0', '0', '4.0', '1772', '443', '1436186570', '1436186570', '0', '0', '讲述了 1932年淞沪抗战时期，掌控上海水路运输线的排会把头洪万川活跃助战，不料遭人暗算，其女婿沈放受伤，待产的女儿洪瑾儿被逼离开上海。一起遭突击的还有中共地下党小组。沈放死里逃生以后，为查询洪万川遇害本相，脱离排会，进入国民党间谍机关任职，与也曾是排会弟子的周一帆变成搭档。沈放、周一帆两人先是尔虞我诈，后从不好走向同仇敌慨。洪瑾儿误解沈放，与沈放失和，亲身坐上排会把头之位。', 'jjvod', '0', '', '第01集$jjhd://30456|b6b34d56521ec259a6cf618cc961f1620c2c3e34|同门往事01.mp4#第02集$jjhd://30456|72c6a1c9830b5b583c67cb72f3dbbf4bad66d761|同门往事02.mp4#第03集$jjhd://30456|fd0c35244bf32ee3478c9ef238680321bd3cb5e6|同门往事03.mp4#第04集$jjhd://30456|97981dc306029703052beaed77bafb203938bd91|同门往事04.mp4#第05集$jjhd://30456|a31f898deb78937ed8c6ebd48de32c0da26aaa53|同门往事05.mp4#第06集$jjhd://30456|c0005048d2f2f785a9994943c8087e184df72374|同门往事06.mp4#第07集$jjhd://30456|3b9868eed3aa13c483bb0b623372e1becf6bc188|同门往事07.mp4#第08集$jjhd://30456|b894bdda9edb44983d9cdeae70924d350f887f03|同门往事08.mp4#第09集$jjhd://30456|befb610e802fc2aeddfa10b4372115bc0109cdf1|同门往事09.mp4#第10集$jjhd://30456|74584496946149d1bfb7cb13a5854be62a2b0b24|同门往事10.mp4#第11集$jjhd://30456|bf52e42666915bc4fd4256f16ceef7373fa1ffb7|同门往事11.mp4#第12集$jjhd://30456|b599a47c0625e9263b77b2613d38d0518629a8fc|同门往事12.mp4#第13集$jjhd://30456|b192abd587afce30ecd7aa6b8134cfc27ec2fce6|同门往事13.mp4#第14集$jjhd://30456|d06d0e798fe33c4dd4f43b3b61cc318efc9ac9ea|同门往事14.mp4#第15集$jjhd://30456|5674868508248cd2b77f1ee909dc5e8c662f1bda|同门往事15.mp4#第16集$jjhd://30456|fc1f550dc19b7270bee8c166bbc34009431dc425|同门往事16.mp4#第17集$jjhd://30456|64ff54535f158fce0ee8ff059a98e9193bc1a377|同门往事17.mp4#第18集$jjhd://30456|5d3d6e91ab368c5516ec83a860c5b582d872422f|同门往事18.mp4#第19集$jjhd://30456|b8d888f003b60cdbe0b56387b7e10bced1f234b6|同门往事19.mp4#第20集$jjhd://30456|4f25eb34381072bc2ff66b4f774d7e98ffbcfcb6|同门往事20.mp4#第21集$jjhd://30456|50ad780d