INSERT INTO `mac_vod` VALUES ('89', '爸爸是条龙', '', 'babashitiaolong', 'B', '', 'http://img.jijizy.com/upload/vod/2015-06-23/201562321495590672.jpg', '', '', '郝平 李菁菁 徐黄丽 谢天华 翁虹 朱璇', '刘一志 寒冬', '', '', '大陆', '国语', '2015', '12', '', '', '0', '0', '0', '40', '0', '0', '0', '0', '537', '0', '0', '0', '0', '0', '0', '5.0', '2275', '455', '1436186570', '1436186570', '0', '0', '实力演员郝平和谢天华在剧中关系亦敌亦友，社会地位、物质条件、价值观念等方面的巨大悬殊导致两位本是同窗的中年大叔走向不同的道路，但千丝万缕的关系让扮演屌丝老爸的郝平和扮演成功商人的谢天华一次次相遇碰撞，在相互较量中成为对方最靠谱的朋友，郝平在帮助谢天华搞定家庭、事业等一系列问题的过程中也得到自我升华，从落魄状态得到自我救赎，从失业大叔变为几个家庭和公司的主要支柱，赢得了家人和朋友的认同和尊敬，被女儿骄傲的说：“我的爸爸是条龙”。', 'jjvod', '0', '', '第01集$jjhd://30456|d4178114ed38e97877e293890ae9faed7d908749|爸爸是条龙01.mp4#第02集$jjhd://30456|71e682a6227170dca792b41fefbff37a50f33bd3|爸爸是条龙02.mp4#第03集$jjhd://30456|92c2b590cbeac3336e4e17f7135391af4e3ed6ac|爸爸是条龙03.mp4#第04集$jjhd://30456|939138bc756b1e268b7f19697d2de3b659a6e5ef|爸爸是条龙04.mp4#第05集$jjhd://30456|a23e25ae3e8a0fd4e54d6c8ae4a5d7c55ee9aa3e|爸爸是条龙05.mp4#第06集$jjhd://30456|68ea7141442beacfad27370a2b4126dd7c731bc4|爸爸是条龙06.mp4#第07集$jjhd://30456|63d55140f614830b0292b84825ac9db871a18089|爸爸是条龙07.mp4#第08集$jjhd://30456|b4ec429b3cfecd9c80aa1429f02ca29d8b6203c4|爸爸是条龙08.mp4#第09集$jjhd://30456|e5b346cf506979008edf4f5a9c66b9e08637a68e|爸爸是条龙09.mp4#第10集$jjhd://30456|694a2a04d9a071d981075e8082780dc99b076969|爸爸是条龙10.mp4#第11集$jjhd://30456|7dd98de96fa4f46d0bb4733127797030e9037dc0|爸爸是条龙11.mp4#第12集$jjhd://30456|050bcfa6a47d62687e5bacf70aeb3d6cacbf50f5|爸爸是条龙12.mp4#第13集$jjhd://30456|0f039218ba40505db797060cba22f00d7760be9a|爸爸是条龙13.mp4#第14集$jjhd://30456|ea0e8d2b27642263845a3e15072434af7e603a95|爸爸是条龙14.mp4#第15集$jjhd://30456|65fe028983fa3f1c9e649b8747e2b145fd9b4168|爸爸是条龙15.mp4#第16集$jjhd://30456|68ab919697f7a33a9021083d98e64538188cc085|爸爸是条龙16.mp4#第17集$jjhd://30456|9e7b27da38a52c0acc707d77ee04c50ca9a064d9|爸爸是条龙17.mp4#第18集$jjhd://30456|bb25764e91427e870d22bc22fcbf3c73ba44f1c7|爸爸是条龙18.mp4#第19集$jjhd://30456|c9d185d2a5f2a8067162e15aa80849588eb92828|爸爸是条龙19.mp4#第20集$jjhd://30456|0ac4a0a1c2f63a722ea8c181a8