INSERT INTO `mac_vod` VALUES ('90', '千手千眼/英雄不流泪', '', 'qianshouqianyanyingxiongbuliulei', 'Q', '', 'http://img.jijizy.com/upload/vod/2015-06-23/201562321522395231.jpg', '', '', '赵文卓  蔡文静  刘雨鑫  陈昊  肖荣生  许绍雄  孙嘉', '内详', '', '全集', '大陆', '国语', '2015', '12', '', '', '0', '0', '0', '42', '0', '0', '0', '0', '965', '0', '0', '0', '0', '0', '0', '2.0', '608', '304', '1436186570', '1436186570', '0', '0', '该剧讲述了警探元震为报国仇家恨而一路行走江湖的故事。     山海关守军教官元震为报家仇，杀了日本人逃到了天津，被日本特务追杀，女大学生程小妍出手相助，使他躲避了追捕。元震当了警察，并找到妻弟孙有德。孙有德成立脚行，深受商会会长曹三泰的凌辱盘剥。曹三泰又对元震下了杀手，程小妍和孙有德拼死将元震救下，并为之输血将他救活。元震与程小妍、孙有德的情义更深了。此时孙有德渐渐漏出贪婪的欲望，暗中扩张势力，渐渐丰满了羽翼。七七事变后日本人占领了天津，孙有德乘机对曹三泰暗下杀手，夺取了商会会长职务。孙有德成立天津内河航运公会，为日军运输军火，成了汉奸。元震调到法租界巡捕房，清查了孙有德的罪行，将孙抓捕归案。元震利用合法身份，在报纸上公开揭露孙有德的罪行，孙成了过街的老鼠人人喊打。日本投降后，元震带警队抓住准备逃跑的孙有德。天津法院将罪大恶极的孙有德判处死刑，万众欢腾。', 'jjvod', '0', '', '第01集$jjhd://30456|2feba407b420116b831c23a70e04996be64c3928|英雄不流泪01.mp4#第02集$jjhd://30456|a12012f4166b03270997cef2d93073a77f8e4377|英雄不流泪02.mp4#第03集$jjhd://30456|a65554b2dd6361296b2b4d0ba43245201b2aac01|英雄不流泪03.mp4#第04集$jjhd://30456|82ce886022c9e7298086f83953516a567898b175|英雄不流泪04.mp4#第05集$jjhd://30456|6ca67412b0c2a6f14b7c45d2784725c28b96341d|英雄不流泪05.mp4#第06集$jjhd://30456|350b32cc27252cd60d289ddbb09ecf9ce8404137|英雄不流泪06.mp4#第07集$jjhd://30456|0ceb6c5f8506196f43b45c4f8a4b806872960bfc|英雄不流泪07.mp4#第08集$jjhd://30456|20fb310db316ac2d5b319402ebd7507fe8e77a54|英雄不流泪08.mp4#第09集$jjhd://30456|b1fba7514161b6605157cf282e0ef700c004e95d|英雄不流泪09.mp4#第10集$jjhd://30456|eecae7eb478812e6da59c2e0089a137512148ac0|英雄不流泪10.mp4#第11集$jjhd://30456|0a5cc307bbd1b0bf0f2018566cc41559d230b3f2|英雄不流泪11.mp4#第12集$jjhd://30456|bf21def503fe7a47afb3643afbf41c736cfd55b9|英雄不流泪12.mp4#第13集$jjhd://30456|3eaa633daa733cd9d316b3fcd7c411a2e1190189|英雄不流泪13.mp4#第14集$jjhd://30456|28ec1acacf7b5c34cffe802008704efd762b8db5|英雄不流泪14.mp4#第15集$jjhd://30456|47527584b2f61c04a37b9aa4ccc3fb56c6e994df|英雄不流泪15.mp4#第16集$jjhd://30456|c7913422f694df86f54a1a97a6b23f6059246f7a|英雄不流泪16.mp4#第17集$jjhd://30456|b1c2b785544d1d6cf0d61563080d88c307aa8250|英