INSERT INTO `mac_vod` VALUES ('95', '劲歌金曲', '', 'jinggejinqu', 'J', '', 'http://img.jijizy.com/upload/vod/2014-05-4/20145418201935345.jpg', '', '', '众明星', '', '', '', '香港', '粤语', '2014', '3', '', '', '0', '0', '0', '20150704', '0', '0', '0', '0', '913', '0', '0', '0', '0', '0', '0', '1.0', '99', '99', '1436186570', '1436187149', '0', '0', '《劲歌金曲》(Jade Solid Gold)是由香港TVB制作的专业流行音乐节目，时至今天成为全球最长寿的华语音乐节目。于1981年10月10日播出第一集，现在仍然是香港最具影响力的音乐节目，目前播出时间为每周五晚19:05在TVB翡翠台及高清翡翠台首播，而高清翡翠台则会在周日晚18:00播出足本1小时版本。另有古巨基同名歌曲《劲歌金曲》。 　　原来节目内容以访问歌手，及播放过去一个星期内的新歌MTV为主。自改版以来，《劲歌金曲》形式转为以MINI concert为主的小型音乐会，内包含数种不同的小单元，其中每周固定播出的是权威乐坛流行指标“劲歌金榜”。《劲歌金曲》也会适时推出一些特别节目，例如2002年世界杯期间举行的《劲歌金曲热唱世界杯》，节目开播25年时开设的《翻转劲歌25年》，其中07年TVB剧集《溏心风暴》大热时举行的《溏心之夜》，邀请剧中演员演唱剧中歌曲，创造19点的高收视，是这档节目在晚上11点档播出以来的最高收视。', 'jjvod$$$xigua', '0$$$', '$$$', '20140503$jjhd://10017|ce3dd8bf287973444422870ee5c96dc8383c63e5|劲歌金曲20140503.rmvb#20140510$jjhd://10017|ad5fa3836ae41bf8e0328d5c0a973d081795c197|劲歌金曲20140510.rmvb#20140517$jjhd://10017|9e996c814aeba0f6ee40a87fb92cd1a6e1f571bd|劲歌金曲20140517.rmvb#20140524$jjhd://10017|716594802f0e13f8616efc278429ea7211a7d840|劲歌金曲20140524.rmvb#20140531$jjhd://10017|d3d0791c1d34a8799c06cd9491cea1cc35bf35c0|劲歌金曲20140531.rmvb#20140607$jjhd://10017|7f1aea7e01468cb6eb52b7796a78fa5a820f73e3|劲歌金曲20140607.rmvb#20140614$jjhd://10017|b9199888388ccb65ba42c54319ccce673f3a26d0|劲歌金曲20140614.rmvb#20140622$jjhd://20000|0d3ca4925288b2ec918998cb25daf9567af338c2|劲歌金曲20140622.rmvb#20140628$jjhd://20000|01ec2547ca3f1f6f7ac8d61b024733cf2ac95f62|劲歌金曲20140628.rmvb#20140712$jjhd://20000|d72140534bd2bcd33ce09ecdb9a1f0eb95207cc7|劲歌金曲20140712.rmvb#20140720$jjhd://20000|e16c000b2395017de8c0b77236e3c6522979a7c5|劲歌金曲20140720.rmvb#20140727$jjhd://20000|56204ad9f1e141b90fa580969a977edb22c370fc|劲歌金曲20140727.rmvb#20140803$jjhd://20000|826b0b034b6ae701e1c551d445d6300f1d1a53ee|劲歌金曲20140803.rmvb#20140810$jjhd://20000|2959830c4eaa21b052bc0aff066b14e02cbb06da|劲歌金曲20140810.rmvb#20140817$jjhd://20000|595a234bc9d3c6fa449d9e7dfe949eefea7c387f|劲歌金