INSERT INTO `mac_vod` VALUES ('98', '恶毒老人同盟', '', 'edulaorentongmeng', 'E', '', 'http://img.jijizy.com/upload/vod/2015-06-22/20156228581636634.jpg', '', '', '姜大卫 元华 郭锋 白彪 黎彼德 李风', '内详', '', '', '香港', '粤语', '2015', '13', '', '', '0', '0', '0', '12', '0', '0', '0', '0', '567', '0', '0', '0', '0', '0', '0', '9.0', '3231', '359', '1436186570', '1436187149', '0', '0', '所谓「家有一老，如有一宝」，但很多老人在生活上常受到歧视。这个故事的五位主角是受尽自己家人、同事和朋友歧视的老人家。一次机缘巧合，五人聚在一起并决定对看不起他们的人报复，所以组成了「恶毒老人同盟」。本剧以轻松的黑色幽默手法带出现今社会老人会遇到的问题和困难，希望观众可以了解老人的难处及对他们孝顺一点', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://20000|706bc5e05efa7aeb1a99b2303fc33539e2dae32e|恶毒老人同盟TV粤语01.mkv#第02集$jjhd://20000|e5f7344e68086c812f2b6251cabef096435a0208|恶毒老人同盟TV粤语02.mkv#第03集$jjhd://20000|3da84415def7e1b52fd35b60920e44839f907f44|恶毒老人同盟TV粤语03.mkv#第04集$jjhd://20000|b03bc1155c717a98ec618ab6ee3469135eb55a1d|恶毒老人同盟TV粤语04.mkv#第05集$jjhd://20000|aae8529945b7e53c8ebcf3fb616427493e62f9fe|恶毒老人同盟TV粤语05.mkv#第06集$jjhd://20000|dedc733f71919611aeba6fed6fcb748933d9c521|恶毒老人同盟TV粤语06.mkv#第07集$jjhd://20000|ff0457163c2cea205d5aceb80c1027dfee6258f0|恶毒老人同盟TV粤语07.mkv#第08集$jjhd://20000|9d77685cfe636352fb375fb55b26a69febc0d9d3|恶毒老人同盟TV粤语08.mkv#第09集$jjhd://20000|b798375d076cf102ef40cd1540af8546ad720803|恶毒老人同盟TV粤语09.mkv#第10集$jjhd://20000|e2af5d7353fd6acb17140ebe29f7036b9f20a136|恶毒老人同盟TV粤语10.mkv#第11集$jjhd://20000|2406ad85677ea0688123f45c7d49eb817e5f5fc2|恶毒老人同盟TV粤语11.mkv#第12集$jjhd://20000|62b2b69ecc45c16368a85a14cb804ae3c49b1cf5|恶毒老人同盟TV粤语12.mkv$$$第01集$ftp://a.gbl.114s.com:20320/0691/恶毒老人同盟TV粤语01.mkv#第02集$ftp://a.gbl.114s.com:20320/4412/恶毒老人同盟TV粤语02.mkv#第03集$ftp://a.gbl.114s.com:20320/6861/恶毒老人同盟TV粤语03.mkv#第04集$ftp://a.gbl.114s.com:20320/1265/恶毒老人同盟TV粤语04.mkv#第05集$ftp://a.gbl.114s.com:20320/2538/恶毒老人同盟TV粤语05.mkv#第06集$ftp://a.gbl.114s.com:20320/2240/恶毒老人同盟TV粤语06.mkv#第07集$ftp://a.gbl.114s.com:20320/3930/恶毒老人同盟TV粤语07.mkv#第08集$ftp://a.gbl.114s.com:20320/8065/恶毒老人同盟TV粤语08.mkv#第09集$ftp://a.gbl.114s.com:20320/8670/恶毒老人同盟TV粤语09.mkv#第10集$ftp://a.gbl.114s.com:20320/2737/恶毒老人同盟TV粤语