INSERT INTO `mac_vod` VALUES ('100', '我的宝贝', '', 'wodebaobei', 'W', '', 'http://img.jijizy.com/upload/vod/2015-07-3/20157320145786648.jpg', '', '', '佟大为 姚笛 刘天佐 徐翠翠', '徐纪周', '', '', '大陆', '国语', '2015', '12', '', '', '0', '0', '0', '6', '0', '0', '0', '0', '69', '0', '0', '0', '0', '0', '0', '8.0', '3824', '478', '1436186578', '1436187159', '0', '0', '刘若男和袁晓凡是一对女强男弱的夫妻。时时吵吵闹闹，离婚常挂嘴边。袁晓凡的好友，求子心切的郭伟达为了帮老婆杨琳完成歌星梦,配合经纪公司炒作，没想到真的炒火了杨琳，而他的事业自此一蹶不振。意外怀孕的刘若男经历了匪夷所思的孕期诞下女儿，袁晓凡“不务正业”当起了全职奶爸，夫妻俩人的战争正式拉开帷幕。小凡用独创的科学养育法和事业萎靡的郭伟达合伙办起了日托小班。若男无法接受小凡的所谓“事业”，两人对彼此心灰意冷。老人们为了阻止他们离婚办法用尽，俩人在和父母的对战中终于明白：婚姻是责任，是共同维系。杨琳发现怀孕，经历过才知道什么最该珍惜，杨琳最终放弃所谓“星途”回归家庭。最终，因为孩子而找到自身价值的郭伟达和袁晓凡两个男人，与各自的那位最适合自己的老婆都行走在幸福的婚姻之路上  。', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://31879|f990d49ef29c34ee24d5c253a4437bc13609ff3f|我的宝贝_HDTV_01.mkv#第02集$jjhd://31879|4d6deb30f64263219fc1688f1cce68b4b9d73308|我的宝贝_HDTV_02.mkv#第03集$jjhd://31879|bc7722f33582515161950e8ce1b9793482573f40|我的宝贝_HDTV_03.mkv#第04集$jjhd://31879|ddf78906f37a6d751e7731be3729e8a723145f61|我的宝贝_HDTV_04.mkv#第05集$jjhd://31879|660731148c19aba5ca730df0b134c3854ca06f96|我的宝贝_HDTV_05.mkv#第06集$jjhd://31879|2dcf77133a87446713e88046361ea24d0ec73083|我的宝贝_HDTV_06.mkv$$$第01集$ftp://a.gbl.114s.com:20320/7551/我的宝贝HDTV01.mp4#第02集$ftp://a.gbl.114s.com:20320/6769/我的宝贝HDTV02.mp4#第03集$ftp://a.gbl.114s.com:20320/6445/我的宝贝HDTV03.mp4#第04集$ftp://a.gbl.114s.com:20320/6436/我的宝贝HDTV04.mp4#第05集$ftp://a.gbl.114s.com:20320/4742/我的宝贝HDTV05.mp4#第06集$ftp://a.gbl.114s.com:20320/8683/我的宝贝HDTV06.mkv', '', '', '', '');
INSERT INTO `mac_vod` VALUES ('101', '马上天下', '', 'mashangtianxia', 'M', '', 'http://img.jijizy.com/upload/vod/2015-07-4/20157420221523838.jpg', '', '', '张鲁一 叶璇 印小天 陶昕然 何润东', '高希希', '', '', '大陆', '国语', '2015', '12', '', '', '0', '0', '0', '5', '0', '0', '0', '0', '872', '0', '0', '0', '0', '0', '0', '4.0', '1824', '456', '1436186578', '1436187159', '0', '0', '该剧改编自徐贵祥原著小说《马上天下》。1928年大革命时期陈秋石为逃避父亲安排的婚姻，在进步青年赵子明的帮助下走上革命道路，被派往黄埔分校学习军事。瘦弱的他却颇具战略天赋，在恩师栽培下成长为将才。因信仰不同最终与恩师分道扬镳。抗日战争爆发，他带领部队以少胜多，屡立奇功。但擅自改变战术，违抗上级命令，使他数次遭贬，几起几落。十七年未回家，从未谋面的儿子陈三川成为其队伍中一名英勇战士，因恨父亲当年对母亲的绝情而拒绝相认。陈秋石满怀愧疚，默默悉心培养、调教着儿子。陈三川对父亲的态度渐渐有了改观。解放战争爆发，陈秋石因掩护战士被炮弹击中。病床前，父子二人终于相认。其后两人联手在战场上谱写出一部感人的战场传奇。', 'jjvod$$$xigua', '0$$$', '$$$', '第01集$jjhd://30456|148cd2f9114911b3f625c9d6c812aa75aff5f052|马上天下HDTV01.mp4#第02集$jjhd://30456|70509917a6b92fdefef2d29544b4f69b336a6440|马上天下HDTV02.mp4#第03集$jjhd://20001|4dab5eb101fdd810b09649163e6bfca46c59031c|马上天下HDTV03.mp4#第04集$jjhd://20001|642added4fe152b71738dba849f3fa6cc6dfc8ae|马上天下HDTV04.mp4#第05集$jjhd://20001|261d2e48d8810c21eebc0b782d2665154bfaa19a|马上天下HDTV05.mp4$$$第01集$ftp://a.gbl.114s.com:20320/3152/马上天下HDTV01.mp4#第02集$ftp://a.gbl.114s.com:20320/9658/马上天下HDTV02.mkv#第03集$ftp://a.gbl.114s.com:20320/0359/马上天下HDTV03.mp4#第04集$ftp://a.gbl.114s.com:20320/4876/马上天下HDTV04.mkv#第05集$ftp://a.gbl.114s.com:20320/4870/马上天下HDTV05.mp4', '', '', '', '');
