INSERT INTO `mac_vod` VALUES ('104', '武则天/武媚娘传奇[港版]', '', 'wuzetianwumeiniangchuanqigangban', 'W', '', 'http://pics.myzyzy.com:8181/upload/vod/2015-04/201542716242866429.jpg', '', '', '范冰冰 李治廷 张丰毅 周海媚 张馨予', '高翊浚', '', '', '大陆', '粤语', '2015', '12', '', '', '0', '0', '0', '67', '0', '0', '0', '0', '981', '664', '633', '839', '0', '0', '0', '6.0', '2298', '383', '1436187128', '1436187128', '0', '0', '故事开始于贞观十一年，如意（范冰冰 饰）参加大唐后宫选举，以一支《兰陵王入阵曲》之物震惊四座，吸引了唐太宗李世民（张丰毅 饰）的注意。然而，春风得意的如玉惨遭奸人所害，还未承宠便被打入了冷宫。一年后，如意被放出冷宫，在宫中的地位节节攀升，这为她带来了爱情与荣耀，却也将其置于了危险之中。 <br />　　李世民听信谗言离开了如意，心碎的如意削发为尼发誓断绝尘缘。然而，腹中的孩子令她决心重回宫中，没想到这一决定却断送了她尚未出世的孩子的性命。复仇心切的如意转而投向了唐高宗李治（李治廷 饰），却同其产生了一段真挚的感情，永微六年，如意终于在一条血路之中攀上了皇后的宝座。', 'xigua', '0', '', '第01集$ftp://a.gbl.114s.com:20320/8725/武则天粤语01.rmvb#第02集$ftp://a.gbl.114s.com:20320/7300/武则天粤语02.rmvb#第03集$ftp://a.gbl.114s.com:20320/6471/武则天粤语03.rmvb#第04集$ftp://a.gbl.114s.com:20320/7974/武则天粤语04.rmvb#第05集$ftp://a.gbl.114s.com:20320/1805/武则天粤语05.rmvb#第06集$ftp://a.gbl.114s.com:20320/0767/武则天粤语HDTV06.mkv#第07集$ftp://a.gbl.114s.com:20320/0524/武则天粤语HDTV07.mkv#第08集$ftp://a.gbl.114s.com:20320/2792/武则天粤语HDTV08.mkv#第09集$ftp://a.gbl.114s.com:20320/4803/武则天粤语HDTV09.mkv#第10集$ftp://a.gbl.114s.com:20320/9923/武则天粤语HDTV10.mkv#第11集$ftp://a.gbl.114s.com:20320/9857/武则天粤语HDTV11.mkv#第12集$ftp://a.gbl.114s.com:20320/6240/武则天粤语HDTV12.mkv#第13集$ftp://a.gbl.114s.com:20320/3963/武则天粤语HDTV13.mkv#第14集$ftp://a.gbl.114s.com:20320/2986/武则天粤语HDTV14.mkv#第15集$ftp://a.gbl.114s.com:20320/4322/武则天粤语HDTV15.mkv#第16集$ftp://a.gbl.114s.com:20320/6346/武则天粤语HDTV16.mkv#第17集$ftp://a.gbl.114s.com:20320/9184/武则天粤语HDTV17.rmvb#第18集$ftp://a.gbl.114s.com:20320/2423/武则天粤语HDTV18.mkv#第19集$ftp://a.gbl.114s.com:20320/7372/武则天粤语HDTV19.rmvb#第20集$ftp://a.gbl.114s.com:20320/5370/武则天粤语HDTV20.rmvb#第21集$ftp://a.gbl.114s.com:20320/4903/武则天粤语HDTV21.rmvb#第22集$ftp://a.gbl.114s.com:20320/0163/武则天粤语HDTV22.mkv#第23集$ftp://a.gbl.114s.com:20320/4846/武则天粤语HDTV23.mkv#第24集$ftp://a.gbl.114s.com:20320/8703/武则天粤语HDTV24.mkv#第25集$ftp://a.gbl.114s.com:20320