INSERT INTO `mac_vod` VALUES ('105', '欢迎入柜/真爱洗剪吹', '', 'huanyingruguizhenaixijianchui', 'H', '', 'http://pics.myzyzy.com:8181/upload/vod/2015-07/2015751749681137.png', '', '', '柯思亚·乌曼 爱琳·缇索 卡嘉·瑞曼', '马可·科因茨沛恩纳', '', 'DVD', '欧美', '英语', '2015', '6', '', '', '0', '0', '0', '0', '0', '0', '0', '0', '982', '313', '158', '149', '0', '0', '0', '9.0', '3834', '426', '1436187128', '1436187128', '1436187255', '0', '这年头，爱异性不见得比爱同性容易。贺汤姆是知名的髮型设计师，也是有名的同性恋，常常抛头露面为了同志权益发声。然而彷彿背负的同志幸福代言人责任的他，却在某天爱上了异性。当社会上已经为他贴上爱男人的标籤，而他也觉得自己应该爱男人的时刻，他的心又该何去何从？ 　　故事从贺汤姆贩卖髮型用品开始，他的投资人要求他得开发女性商品，但爱男人的他哪知道女人爱哪一味。最后只好被迫到一间髮廊实习，看看这些他搞不定的女人们都想要什麽。和髮廊老闆海蒂水火不容的他，不知不觉竟和对方看对眼，但他可是同志的楷模，而且海蒂也有固定的伴侣，一切彷彿大笑话。', 'xigua', '0', '', 'DVD$ftp://a.gbl.114s.com:20320/8396/欢迎入柜DVD中德双字.mkv', '', '', '', '');
