INSERT INTO `mac_vod` VALUES ('107', 'Running Man', '', 'RunningMan', 'R', '', 'http://pics.myzyzy.com:8181/upload/vod/2014-05/2014550295144385.jpg', '', '', '刘在石 池石镇 金钟国', '内详', '', '', '日韩', '韩语', '2014', '3', '', '', '0', '0', '0', '20150705', '0', '0', '0', '0', '79', '55', '760', '30', '0', '0', '0', '3.0', '858', '286', '1436187128', '1436187128', '0', '0', '刘在石再次投入SBS的新娱乐节目《Running Man》的準备中，本次新节目从出演人物开始已经收到相当大的关注。 世界杯结束，将在7月首次放送《Running Man》，导致观众们好奇心的地方在于，刘在石和成员们没有空闲地跑动、洋溢着活跃的对决，展开独特概念的节目。 每周计划无论歌手、演员、笑星、运动员等领域作为新嘉宾出演。 《Running Man》固定成员除了包括池石镇、金钟国、HAHA外，还有因《穿透屋顶的high kick》被喜爱的李光秀、演员宋钟基，随同Hip-Hop二人组“Leessang”成员Gary一起，发觉潜藏的艺能感。', 'xigua', '0', '', '20140406$ftp://pub:pub@a.gbl.114s.com:20320/94f/Running Man20140406.mkv#20140413$ftp://pub:pub@a.gbl.114s.com:20320/5c0/Running Man20140413.mkv#20140504$ftp://pub:pub@a.gbl.114s.com:20320/a1e/RunningMan20140504.mkv#20140511$ftp://pub:pub@a.gbl.114s.com:20320/cf2/RunningMan20140511.mkv#20140518$ftp://pub:pub@a.gbl.114s.com:20320/18b/RunningMan20140518.mkv#20140525$ftp://pub:pub@a.gbl.114s.com:20320/bc5/RunningMan20140525.rmvb#20140601$ftp://a.gbl.114s.com:20320/2507/Runningman之20140601.rmvb#20140608$ftp://a.gbl.114s.com:20320/8164/RunningMan20140608.mp4#20140615$ftp://a.gbl.114s.com:20320/3933/RunningMan20140615.mkv#20140622$ftp://a.gbl.114s.com:20320/0835/RunningMan20140622.mkv#20140629$ftp://a.gbl.114s.com:20320/2908/RunningMan20140629.mkv#20140706$ftp://a.gbl.114s.com:20320/1053/RunningMan20140706.mkv#20140713$ftp://a.gbl.114s.com:20320/0380/RunningMan20140713.mkv#20140720$ftp://a.gbl.114s.com:20320/1695/runningman20140720.mkv#20140727$ftp://a.gbl.114s.com:20320/8667/RunningMan20140727.mkv#20140803$ftp://a.gbl.114s.com:20320/2488/RunningMan之20140803.rmvb#20140810$ftp://a.gbl.114s.com:20320/4187/RunningMan20140810.rmvb#20140817$ftp://a.gbl.114s.com:20320/2121/RunningMan20140817.rmvb#20140824$ftp://a.gbl.114s.com:20320/6315/RunningMan之20140824.rmvb#20140831$ftp://a.gbl.114s.com:20320/5345/RunningMan20140831.mkv#20140