INSERT INTO `mac_vod` VALUES ('108', 'Puripara/美妙天堂', '', 'Puriparameimiaotiantang', 'P', '', 'http://pics.myzyzy.com:8181/upload/vod/2014-07/201477815353357.jpg', '', '', '茜屋日海夏 芹泽优 久保田未梦', '内详', '', '', '日本', '日语', '2014', '4', '', '', '0', '0', '0', '52', '0', '0', '0', '0', '372', '115', '585', '800', '0', '0', '0', '8.0', '1912', '239', '1436187137', '1436187137', '0', '0', '某一天，一封招待信送到了一群妙龄少女的手中。这个招待信可不一般，那是融合了时尚、舞蹈、音乐等女孩子梦想的“Puripara”世界入场券。在那儿，每天都可以参加唱歌、跳舞、时尚比拼的竞赛， 而比赛实况也将通过电视和网络向全世界播出。如今顶级的偶像都是从“PuriPara”当中诞生的。<br />主人公真中啦啦和她的朋友们也对于“PuriPara”的世界充满兴趣。不过身为小学生的啦啦所在的学校却禁止小学生参加这些活动……然而，因为一次奇妙的契机，啦啦第一次走进这个传说中的世界，结果还登上了比赛的舞台。那么啦啦的“PuriPara”出道演出究竟会如何呢！？', 'xigua', '0', '', '第01集$ftp://a.gbl.114s.com:20320/0047/美妙天堂01.mp4#第02集$ftp://a.gbl.114s.com:20320/0908/美妙天堂02.mp4#第03集$ftp://a.gbl.114s.com:20320/0748/美妙天堂03.mp4#第04集$ftp://a.gbl.114s.com:20320/6268/美妙天堂04.mp4#第05集$ftp://a.gbl.114s.com:20320/8386/美妙天堂05.mp4#第06集$ftp://a.gbl.114s.com:20320/9166/美妙天堂06.mp4#第07集$ftp://a.gbl.114s.com:20320/7383/美妙天堂07.mp4#第08集$ftp://a.gbl.114s.com:20320/9072/美妙天堂08.mp4#第09集$ftp://a.gbl.114s.com:20320/4150/美妙天堂09.mp4#第10集$ftp://a.gbl.114s.com:20320/6389/美妙天堂10.mp4#第11集$ftp://a.gbl.114s.com:20320/6143/美妙天堂11.mp4#第12集$ftp://a.gbl.114s.com:20320/4569/美妙天堂12.mp4#第13集$ftp://a.gbl.114s.com:20320/5906/美妙天堂13.mp4#第14集$ftp://a.gbl.114s.com:20320/9606/美妙天堂14.mp4#第15集$ftp://a.gbl.114s.com:20320/2022/美妙天堂15.mp4#第16集$ftp://a.gbl.114s.com:20320/4754/美妙天堂16.mp4#第17集$ftp://a.gbl.114s.com:20320/0802/Pripara17.mkv#第18集$ftp://a.gbl.114s.com:20320/2041/美妙天堂18.mkv#第19集$ftp://a.gbl.114s.com:20320/9897/美妙天堂19.mp4#第20集$ftp://a.gbl.114s.com:20320/9777/美妙天堂20.mp4#第21集$ftp://a.gbl.114s.com:20320/5544/美妙天堂21.mp4#第22集$ftp://a.gbl.114s.com:20320/5658/美妙天堂22.mp4#第23集$ftp://a.gbl.114s.com:20320/4939/美妙天堂23.mp4#第24集$ftp://a.gbl.114s.com:20320/3733/美妙天堂24v2.mp4#第25集$ftp://a.gbl.114s.com:20320/9541/美妙天堂25.mp4#第26集$ftp://a.gbl.114s.com:20320/3843/美妙天堂26.mp4#第27集$ftp://a.gbl.114s.com:20320/8409/美妙天堂27.mp4#第28集$ftp://a.gbl