INSERT INTO `mac_vod` VALUES ('109', '警视厅捜査一课九系第十季', '', 'jingshitingyikejiuxidishiji', 'J', '', 'http://pics.myzyzy.com:8181/upload/vod/2014-10/2014101314344597431.jpg', '', '', '渡瀬恒彦 井ノ原快彦 羽田美智子', '长谷川康', '', 'SP', '日本', '日语', '2014', '10', '', '', '0', '0', '0', '10', '0', '0', '0', '0', '71', '879', '178', '461', '0', '0', '0', '2.0', '394', '197', '1436187137', '1436187137', '0', '0', '九系第九季完结后SP再现！食物中毒、旅游车爆炸，被害者众多，先是旅游公司老板被杀，凶手自杀，接着食品公司老 板被杀，凶手同样自杀，这一切有着怎样的关系？两个事件中，出现的同一个律师同一个记者，她们与谋杀案又将有怎 样的联系？让我们和九系一同来拨开迷雾寻找事件的真相！', 'xigua', '0', '', '第01集$ftp://a.gbl.114s.com:20320/9324/警视厅捜査一课九系第十季01.mp4#第02集$ftp://a.gbl.114s.com:20320/1790/警视厅捜査一课九系第十季02.mp4#第03集$ftp://a.gbl.114s.com:20320/8530/警视厅捜査一课九系第十季03.mp4#第04集$ftp://a.gbl.114s.com:20320/6157/警视厅捜査一课九系第十季04.mp4#第05集$ftp://a.gbl.114s.com:20320/0603/警视厅捜査一课九系第十季05.mp4#第06集$ftp://a.gbl.114s.com:20320/1220/警视厅捜査一课九系第十季06.mp4#第07集$ftp://a.gbl.114s.com:20320/0620/警视厅捜査一课九系第十季07.mp4#第08集$ftp://a.gbl.114s.com:20320/0385/警视厅捜査一课九系第十季08.mp4#第09集$ftp://a.gbl.114s.com:20320/8383/警视厅捜査一课九系第十季09.mp4#第10集$ftp://a.gbl.114s.com:20320/7495/警视厅捜査一课九系第十季10.mp4#SP$ftp://a.gbl.114s.com:20320/1082/警视厅搜查一课9係10月SP.mp4', '', '', '', '');
INSERT INTO `mac_vod` VALUES ('110', '真实的人类/Humans', '', 'zhenshiderenleiHumans', 'Z', '', 'http://pics.myzyzy.com:8181/upload/vod/2015-06/201561518182948021.jpg', '', '', '威廉·赫特 科林·摩根 嘉玛·陈', 'Jonathan Brackley', '', '', '欧美', '英语', '2015', '15', '', '', '0', '0', '0', '4', '0', '0', '0', '0', '351', '28', '456', '397', '0', '0', '0', '8.0', '1872', '234', '1436187149', '1436187149', '0', '0', '由出品四届艾美奖最佳影集【广告狂人】、两届艾美奖最佳影集【绝命毒师】、艾美奖四项提名作品【谋杀】和金球奖最佳影集提名及美国最高收视电视作品【行尸走肉】的金奖电视网AMC，与出品BAFTA英国电影和电视艺术学院奖最佳电视影集【乌托邦】、 【小镇疑云】的英国电视4台，跨越国界，双剑合璧，携手联合制作的八集电视影集《真实的人类》将于六月廿八日晚上九时在美国首映。这出全新科幻影集改编自备受评论界激赞的瑞典获奖科幻影集《Real Humans》，并由英国编剧Sam Vincent 和Jonathan Brackley (【反恐谍报战】) 执笔重新创作剧本。该剧设定在机器人Synth被繁忙都市人广泛使用的世界，呈现人类与机器人的界限愈发模糊后，扣人心弦的矛盾冲突、心理冲击与道德拷问。', 'xigua', '0', '', '第01集$ftp://a.gbl.114s.com:20320/3897/真实的人类第一季01.mp4#第02集$ftp://a.gbl.114s.com:20320/4560/真实的人类第一季02.mp4#第03集$ftp://a.gbl.114s.com:20320/2152/真实的人类第一季03.mp4#第04集$ftp://a.gbl.114s.com:20320/2630/真实的人类第一季04.mp4', '', '', '', '');
