INSERT INTO `mac_vod` VALUES ('113', '生死兄弟情', '', 'shengsixiongdiqing', 'S', '', 'http://pics.myzyzy.com:8181/upload/vod/2015-06/201562719495752384.jpg', '', '', '郭晓冬 车永莉 王斑', '萧锋', '', '', '大陆', '国语', '2013', '12', '', '', '0', '0', '0', '32', '0', '0', '0', '0', '185', '777', '248', '69', '0', '0', '0', '9.0', '1575', '175', '1436187159', '1436187159', '1436187294', '0', '1949年初，大批以农村干部为主的解放军部队进入城市。马安山和乔梁是一对异姓兄弟，从小一起长大的富家子弟乔梁对自己奶妈的儿子马安山有救命之恩，两人情同手足。上级任命马安山为临江军管会主任，乔梁为副主任。接管城市后的共产党干部们面临着如何从革命党转为执政党的严峻考验。马安山和乔梁这两个城市管理者产生了冲突。在经历一系列挫折后，马安山在实践中得到了成长。然而城市的稳定，经济的发展造成腐败滋长。总想用自己的才华为国家建功立业的乔梁，一直为自己生活在哥哥马安山阴影下感到沮丧。他在纠结和挣扎之中走向堕落和腐化。乔梁被绳之于法，新城临江也在风雨中重获新生。这是一次血的教训，是在我们党的全新政权建立之初，值得执政者们警醒的城市之路。', 'xigua', '0', '', '第01集$ftp://a.gbl.114s.com:20320/8312/生死兄弟情TV01.mp4#第02集$ftp://a.gbl.114s.com:20320/0236/生死兄弟情TV02.mkv#第03集$ftp://a.gbl.114s.com:20320/4813/生死兄弟情TV03.mp4#第04集$ftp://a.gbl.114s.com:20320/0250/生死兄弟情TV04.mp4#第05集$ftp://a.gbl.114s.com:20320/7857/生死兄弟情TV05.mp4#第06集$ftp://a.gbl.114s.com:20320/1097/生死兄弟情TV06.mp4#第07集$ftp://a.gbl.114s.com:20320/5983/生死兄弟情TV07.mp4#第08集$ftp://a.gbl.114s.com:20320/9079/生死兄弟情TV08.mp4#第09集$ftp://a.gbl.114s.com:20320/9776/生死兄弟情TV09.mp4#第10集$ftp://a.gbl.114s.com:20320/9432/生死兄弟情TV10.mp4#第11集$ftp://a.gbl.114s.com:20320/3046/生死兄弟情TV11.mp4#第12集$ftp://a.gbl.114s.com:20320/7751/生死兄弟情TV12.mp4#第13集$ftp://a.gbl.114s.com:20320/3402/生死兄弟情TV13.mkv#第14集$ftp://a.gbl.114s.com:20320/8222/生死兄弟情TV14.mp4#第15集$ftp://a.gbl.114s.com:20320/4751/生死兄弟情TV15.mp4#第16集$ftp://a.gbl.114s.com:20320/2620/生死兄弟情TV16.mp4#第17集$ftp://a.gbl.114s.com:20320/4425/生死兄弟情TV17.mp4#第18集$ftp://a.gbl.114s.com:20320/3840/生死兄弟情TV18.mp4#第19集$ftp://a.gbl.114s.com:20320/1304/生死兄弟情TV19.mp4#第20集$ftp://a.gbl.114s.com:20320/2067/生死兄弟情TV20.mp4#第21集$ftp://a.gbl.114s.com:20320/3245/生死兄弟情TV21.mp4#第22集$ftp://a.gbl.114s.com:20320/1838/生死兄弟情TV22.mp4#第23集$ftp://a.gbl.114s.com:20320/3936/生死兄弟情TV23.mp4#第24集$ftp://a.gbl.114s.com:20320/0623/生死兄弟情TV24.mp4#第25集$ftp://a.gbl.114s.com:20320/2036/生死兄弟情TV25.mp4#第26集$ftp://a.