INSERT INTO `mac_vod` VALUES ('114', '福根进城', '', 'fugenjincheng', 'F', '', 'http://pics.myzyzy.com:8181/upload/vod/2015-05/20155162181164910.jpg', '', '', '赵毅 柴碧云 王丽云', '内详', '', '', '大陆', '国语', '2015', '12', '', '', '0', '0', '0', '6', '0', '0', '0', '0', '348', '955', '523', '382', '0', '0', '0', '3.0', '471', '157', '1436187159', '1436187159', '1436187234', '0', '农村姑娘灵芝考上了大学，来到了省城，为陪伴灵芝上学未婚夫福根也进了城。为了实现明星梦的元宝、一直想发大财的六哥、羡慕城里人生活的丽丽、消极逃避责任的胡哥等怀揣不同的目地都汇聚到了省城，开始了他们漫长而艰辛的城市打工生涯。面对眼花缭乱的新生活，福根始终坚守自己的勤劳、善良和诚实，与灵芝的情感却分分合合；元宝为了实现自己的梦想不惜牺牲了自己的爱情；六哥的生活起起落落很是艰辛；丽丽为过上城里人的生活付出了巨大的代价，胡哥也在福根的劝说下勇于承担责任。最终，福根用他可爱的傻劲与无限的真诚感动了这座城市，感动了许许多多执迷不悟的人们，在城里闯出了一片天地并赢回了属于自己的爱情 。', 'xigua', '0', '', '第01集$ftp://a.gbl.114s.com:20320/3280/福根进城HDTV01.mp4#第02集$ftp://a.gbl.114s.com:20320/7864/福根进城HDTV02.mp4#第03集$ftp://a.gbl.114s.com:20320/2394/福根进城HDTV03.mp4#第04集$ftp://a.gbl.114s.com:20320/2561/福根进城HDTV04.mp4#第05集$ftp://a.gbl.114s.com:20320/1316/福根进城HDTV05.mp4#第06集$ftp://a.gbl.114s.com:20320/9818/福根进城HDTV06.mkv', '', '', '', '');
INSERT INTO `mac_vod` VALUES ('115', '罗龙镇女人', '', 'luolongzhennvren', 'L', '', 'http://pics.myzyzy.com:8181/upload/vod/2015-06/2015627200975180.jpg', '', '', '黄维德 苗圃 赫子铭', '黄建勋', '', '', '大陆', '国语', '2015', '12', '', '', '0', '0', '0', '19', '0', '0', '0', '0', '608', '297', '511', '935', '0', '0', '0', '3.0', '147', '49', '1436187159', '1436187159', '0', '0', '1935年初。罗龙镇的杨春兰、杨夏荷姐妹无意中被卷入当地大户文家和土匪虎帮的混战中，并因表现出色被文太公相中，成为文氏宗族的媳妇候选人。其时，田田早已与青梅竹马的冉天放心意相同，二人历尽艰辛后终能厮守终身，未料翻山越境时遭匪，冉天放为护田田中枪摔下山崖。田田痛不欲生，幸而文家大少爷文孝礼用深情将她从痛苦中拉回。婚后，田田忠心尽责将文家治理得井然有序，却不知兰兰仍为冉天放的死怀恨于她，姐妹二人隔阂日深。岁月动荡，田田不得已当上了“女匪首”，带领一群受压迫的姐妹奋起反抗，而兰兰却成为特派剿匪的国军军官，与姐姐数次生死对峙。然而当抗日战争爆发，姐妹俩却放下了所有个人恩怨，高举民族大义之旗，率领众姐妹前仆后继，浴血杀敌，最终为保护家园而战死沙场。', 'xigua', '0', '', '第01集$ftp://a.gbl.114s.com:20320/6932/罗龙镇女人HDTV01.mp4#第02集$ftp://a.gbl.114s.com:20320/9427/罗龙镇女人HDTV02.mp4#第03集$ftp://a.gbl.114s.com:20320/3548/罗龙镇女人HDTV03.mp4#第04集$ftp://a.gbl.114s.com:20320/0460/罗龙镇女人HDTV04.mp4#第05集$ftp://a.gbl.114s.com:20320/3375/罗龙镇女人HDTV05.mp4#第06集$ftp://a.gbl.114s.com:20320/7862/罗龙镇女人HDTV06.mp4#第07集$ftp://a.gbl.114s.com:20320/6443/罗龙镇女人HDTV07.mp4#第08集$ftp://a.gbl.114s.com:20320/2732/罗龙镇女人HDTV08.mp4#第09集$ftp://a.gbl.114s.com:20320/2924/罗龙镇女人HDTV09.mp4#第10集$ftp://a.gbl.114s.com:20320/0459/罗龙镇女人HDTV10.mkv#第11集$ftp://a.gbl.114s.com:20320/9633/罗龙镇女人HDTV11.mp4#第12集$ftp://a.gbl.114s.com:20320/0636/罗龙镇女人HDTV12.mp4#第13集$ftp://a.gbl.114s.com:20320/6861/罗龙镇女人HDTV13.mp4#第14集$ftp://a.gbl.114s.com:20320/3984/罗龙镇女人HDTV14.mp4#第15集$ftp://a.gbl.114s.com:20320/8567/罗龙镇女人HDTV15.mp4#第16集$ftp://a.gbl.114s.com:20320/5914/罗龙镇女人HDTV16.mkv#第17集$ftp://a.gbl.114s.com:20320/4156/罗龙镇女人HDTV17.mp4#第18集$ftp://a.gbl.114s.com:20320/8509/罗龙镇女人HDTV18.mp4#第19集$ftp://a.gbl.114s.com:20320/7258/罗龙镇女人HDTV19.mp4', '', '', '', '');
